(2128, 'en', 'buddypress', '93553b085f66e8a8791c87736f172194', '%1$s wrote a new <a href="%2$s">item</a>, on the site %3$s', NULL, 'LINE', NULL, 0, 'Activity Custom Post Type post action', '1309c4bddbd08c3b44dd0264e3977a31'),
