(2130, 'en', 'buddypress', '6d78666dc53bc7ec422805d840a96d91', '%1$s commented on the <a href="%2$s">item</a>, on the site %3$s', NULL, 'LINE', NULL, 0, 'Activity Custom Post Type comment action', 'cbead3347d8fb1ed6eb970b3edcfd65a'),
(2131, 'en', 'buddypress', '046be9465d4c68ecd4a5c307994218f8', '%1$s commented on the <a href="%2$s">item</a>', NULL, 'LINE', NULL, 0, 'Activity Custom Post Type post comment action', 'ab87ba19f167be13682cd725d722593a'),
(2132, 'en', 'buddypress', '92ce1cdb3e8bb9602d58881eed6a170c', 'ERROR: Please type a reply.', NULL, 'LINE', NULL, 0, '', '133f522b5421de4b20225bbbe3ea052e'),
(2133, 'en', 'buddypress', '8e6382b0e61b26eb4c4ffc756bd969fc', 'ERROR: The item you are trying to reply to cannot be found, or it has been deleted.', NULL, 'LINE', NULL, 0, '', 'c1a9ad8271a63d69459827cae2c2f2d2'),
(2134, 'en', 'buddypress', 'ea6ed02e69ad8d1775e170bbfb6b7300', 'You edit activities made on your site similar to the way you edit a comment. This is useful if you need to change which page the activity links to, or when you notice that the author has made a typographical error.', NULL, 'LINE', NULL, 0, '', '9cc3c17d80497be46669ef16903b2af9'),
(2135, 'en', 'buddypress', '3068ac16a69d5d963691467e22a23a2a', 'The two big editing areas for the activity title and content are fixed in place, but you can reposition all the other boxes using drag and drop, and can minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Primary Item/Secondary Item, Link, Type, Author ID) or to choose a 1- or 2-column layout for this screen.', NULL, 'LINE', NULL, 0, '', 'cf57b711da1c3908ad9583ec7e3a5030'),
(2136, 'en', 'buddypress', '506d9d03be17ea0fa11048df6d30a6c2', 'You can also moderate the activity from this screen using the Status box, where you can also change the timestamp of the activity.', NULL, 'LINE', NULL, 0, '', 'be4f0f5126b0aa0577169f6d545b731a'),
(2137, 'en', 'buddypress', '2859ff7e8bf93b543f821d8959026152', 'Item, Link, Type', NULL, 'LINE', NULL, 0, '', '4b8290372bb8a6580343e462219247cb'),
(2138, 'en', 'buddypress', '45b4e6a6587f1d6514fc8c2eea66f1b6', '<strong>Primary Item/Secondary Item</strong> - These identify the object that created the activity. For example, the fields could reference a comment left on a specific site. Some types of activity may only use one, or none, of these fields.', NULL, 'LINE', NULL, 0, '', '56f1632c17c02dacd7eba8f6264e0118'),
(2139, 'en', 'buddypress', 'e31f853fbf523cfeef1db63477e14009', '<strong>Link</strong> - Used by some types of activity (e.g blog posts and comments, and forum topics and replies) to store a link back to the original content.', NULL, 'LINE', NULL, 0, '', 'c6dfa3bce7a0b4cbdd396b1859de4450'),
(2140, 'en', 'buddypress', '3dde58c44a63e048cfabcf96282e66e1', '<strong>Type</strong> - Each distinct kind of activity has its own type. For example, <code>created_group</code> is used when a group is created and <code>joined_group</code> is used when a user joins a group.', NULL, 'LINE', NULL, 0, '', 'ab914b1ad09ac4cd6b6a0df87ee44e8d'),
(2141, 'en', 'buddypress', '1f4c905d9a4b787ac6bb92f9a017a34f', 'For information about when and how BuddyPress uses all of these settings, see the Managing Activity link in the panel to the side.', NULL, 'LINE', NULL, 0, '', 'bcbb9129d787be640ab0fd2c3ad42b2a'),
(2142, 'en', 'buddypress', '36c3d2e7a2a2c556df288f988cd98ed7', '<a href="https://codex.buddypress.org/administrator-guide/activity-stream-management-panels/">Managing Activity</a>', NULL, 'LINE', NULL, 0, '', 'c1bad43357b09622eccca0a3f83fcf5f'),
(2143, 'en', 'buddypress', '3ccaedd1e3fc8490ddde1f7b7d2f443f', 'You can manage activities made on your site similar to the way you manage comments and other content. This screen is customizable in the same ways as other management screens, and you can act on activities using the on-hover action links or the Bulk Actions.', NULL, 'LINE', NULL, 0, '', '964ffc9a6b1a88c47366a064653f0cac'),
(2144, 'en', 'buddypress', '49e3ae23071ca4f288697b96d1ca11e1', 'There are many different types of activities. Some are generated automatically by BuddyPress and other plugins, and some are entered directly by a user in the form of status update. To help manage the different activity types, use the filter dropdown box to switch between them.', NULL, 'LINE', NULL, 0, '', '047192ca6154ace16029e6205ee60d62'),
(2145, 'en', 'buddypress', '259c509b830f8d5b56960854182d8e0a', 'Moderating Activity', NULL, 'LINE', NULL, 0, '', '32e4e2c1325cf0a1ce00a2e7144823d0'),
(2146, 'en', 'buddypress', '452b58bf6dee3f1978e3854a855c78c0', 'In the <strong>Activity</strong> column, above each activity it says &#8220;Submitted on,&#8221; followed by the date and time the activity item was generated on your site. Clicking on the date/time link will take you to that activity on your live site. Hovering over any activity gives you options to reply, edit, spam mark, or delete that activity.', NULL, 'LINE', NULL, 0, '', '31628356dc779bc5bbc663f74e058eab');
INSERT INTO `jd_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`) VALUES
(2147, 'en', 'buddypress', 'cf00913a32d65a6933fc528033814860', 'In the <strong>In Response To</strong> column, if the activity was in reply to another activity, it shows that activity\'s author\'s picture and name, and a link to that activity on your live site. If there is a small bubble, the number in it shows how many other activities are related to this one; these are usually comments. Clicking the bubble will filter the activity screen to show only related activity items.', NULL, 'LINE', NULL, 0, '', 'eedb465497cd9305159258ca525b4c89'),
(2148, 'en', 'buddypress', '78bae046500f792b3ea8a780ce02ad33', 'Activity list navigation', NULL, 'LINE', NULL, 0, '', '52307c6f4dcbd8bb5da9dbf961c49e97'),
