(2165, 'en', 'buddypress', '1c32566e09ba3c71f57fb860156153ea', 'Activity generated by posts and comments, forum topics and replies, and some plugins, uses the link field for a permalink back to the content item.', NULL, 'LINE', NULL, 0, '', '2dcc71d52832923ebb7af6b5c9b03c6c'),
