(2169, 'en', 'buddypress', '74b04c60f5600bdd27c6f0806ca26c62', 'These identify the object that created this activity. For example, the fields could reference a pair of site and comment IDs.', NULL, 'LINE', NULL, 0, '', 'cab0994a159a54fc3f99de5ede5d1e9f'),
