(2399, 'en', 'buddypress', '4e1a2101ffbcb63fab3ad7e16b0fe10d', 'BuddyPress will now use its internal copy of bbPress to run the forums on your site. If you wish, you can remove your old bbPress installation files, as long as you keep the bb-config.php file in the same location.', NULL, 'LINE', NULL, 0, '', '2323c90a3ddff1241654f8bb9f40f1ef'),
