(2401, 'en', 'buddypress', 'e86db936532e9793d0c49bc380108946', 'BuddyPress can make use of your existing bbPress install. Just provide the location of your <code>bb-config.php</code> file, and BuddyPress will do the rest.', NULL, 'LINE', NULL, 0, '', 'f15a245302809dbc2b91fd9ec8a6cb28'),
(2402, 'en', 'buddypress', 'e36ec2512f383d8872a3918b2842f60c', 'All done! Configuration settings have been saved to the file <code>bb-config.php</code> in the root of your WordPress install.', NULL, 'LINE', NULL, 0, '', 'f8a5815bff3bc995b7156456a9d803fb'),
(2403, 'en', 'buddypress', '4859928b10ba690b652291cc3c768a11', 'A configuration file could not be created. No problem, but you will need to save the text shown below into a file named <code>bb-config.php</code> in the root directory of your WordPress installation before you can start using the forum functionality.', NULL, 'LINE', NULL, 0, '', '9a4d123d166c44e2361f0d57a8c361bb'),
