(2454, 'en', 'WordPress', '666c5c52e1bc7d8726e0e8d4af5a1645', 'We\'re now going to go through a few steps to get you up and running.', NULL, 'LINE', NULL, 0, '', 'a71c34e4d026dfa4b62d72ef6681c4e2'),
