(2459, 'en', 'WordPress', '29408e815a6c812779a0d38b2dd2526b', 'In this step you need to enter your database connection details. The installer will attempt to create a file called <code>bb-config.php</code> in the root directory of your bbPress installation.', NULL, 'LINE', NULL, 0, '', '3ac66473c46744c02d6cbb63037d1117'),
