(2478, 'en', 'WordPress', 'e472f5d4bfc37404f7c6094ec8847abd', 'Usually this is caused by one of the database connection settings being incorrect. Make sure that the specified user has appropriate permission to access the database.', NULL, 'LINE', NULL, 0, '', '17d49c4c9d6f56ec5d53b11af29485ca'),
