(2957, 'en', 'WordPress', '4bc8ea159641bfb563a4597cf80715e9', 'This must match the value of the WordPress setting named "secure_auth_salt" in your WordPress site. Look for the option labeled "secure_auth_salt" in <a href="#" id="getSecureAuthSaltOption" onclick="window.open(this.href); return false;">this WordPress admin page</a>. Sometimes this value is not set in WordPress, in that case you can leave this setting blank as well.', NULL, 'LINE', NULL, 0, '', '3ffe33f57186f45be2b7b8c0c09f4f6b'),
