(5648, 'en', 'WordPress', '5ab38f9a802f2206ec16bc748d6c9de1', '<a href="https://codex.wordpress.org/Using_Themes" target="_blank">Documentation on Using Themes</a>', NULL, 'LINE', NULL, 10, '', '18c2a446c44b27e8c8ecc8bcca86539a'),
