(5650, 'en', 'WordPress', '3f7e7d202a9708656985eebbdf3cc03c', '<a href="https://codex.wordpress.org/Version_%1$s">WordPress %1$s</a> is available! <a href="%2$s" aria-label="Please update WordPress now">Please update now</a>.', NULL, 'LINE', NULL, 10, '', '82dbce3fb8f8daf16350950983e679e3'),
(5651, 'en', 'WordPress', '50e18e350dce4aced34664393b976365', '<a href="https://codex.wordpress.org/Version_%1$s">WordPress %1$s</a> is available! Please notify the site administrator.', NULL, 'LINE', NULL, 10, '', '2f25bc80c7b7b94277bc2a005a3feb70'),
(5652, 'en', 'WordPress', '4f1a104e64bdaba29190944499144e8b', '<a href="https://codex.wordpress.org/Writing_a_Plugin" target="_blank">Documentation on Writing Plugins</a>', NULL, 'LINE', NULL, 10, '', '0404e10c3b0aaa2ad5d281d0a7d7431f'),
(5653, 'en', 'WordPress', '9b6f15e83f653c318ec6e21b47cc1a0d', '<a href="https://wordpress.org/support/" target="_blank">Support Forums</a>', NULL, 'LINE', NULL, 10, '', '63aff64345119f70fcb48b8d8969281e'),
(5654, 'en', 'WordPress', '4219e9a017987428685266b8afb91d80', '<code>_blank</code> &mdash; new window or tab.', NULL, 'LINE', NULL, 10, '', '88fc1e7c54ce0eae1efc0f22bc917bdd'),
(5655, 'en', 'WordPress', '54664b363fac4157930a3f35531b297a', '<code>_none</code> &mdash; same window or tab.', NULL, 'LINE', NULL, 10, '', 'bbbbe51eefcd50c8066648b90c82c77a'),
(5656, 'en', 'WordPress', 'd0e80edbec66288a957ad0381ae03505', '<code>_top</code> &mdash; current window or tab, with no frames.', NULL, 'LINE', NULL, 10, '', 'eab30936be7d6813ba7f69e68152ae47'),
(5657, 'en', 'WordPress', '2e9457fe36435e48a296c4a614e71a4f', '<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.', NULL, 'LINE', NULL, 10, '', '500f7195ec3b5299c560e75e95e9b4a0'),
(5658, 'en', 'WordPress', 'f067f6f2a07a9f28b8acd051de12bd8f', '<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.', NULL, 'LINE', NULL, 10, '', 'e72c18794f3873513bbaf317e0bc0240'),
(5659, 'en', 'WordPress', 'ecdb52fb00d5aabe4e9d24b436f9b9fc', '<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.', NULL, 'LINE', NULL, 10, '', 'f84e1c5e90f749b550f71b6a28c403fd'),
(5660, 'en', 'WordPress', 'a6babfcb475f676a839ed6c0640d1a7d', '<strong>Advice:</strong> think very carefully about your site crashing if you are live-editing the theme currently in use.', NULL, 'LINE', NULL, 10, '', '4fe4fd62ced65470db015b405273dd32'),
(5661, 'en', 'WordPress', 'a8f4d14621490c3a1b94015a6744f684', '<strong>At A Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.', NULL, 'LINE', NULL, 10, '', 'bb8260e32ed9c436be4f418625aa45e7'),
(5662, 'en', 'WordPress', 'b65fa8d75f92ea10c226c9c9e107cfc6', '<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.', NULL, 'LINE', NULL, 10, '', '31667f35cbd471b0c7c548f3a5a4ad0b'),
(5663, 'en', 'WordPress', '2bc2b92ef21e54b7d57719af3e03b906', '<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.', NULL, 'LINE', NULL, 10, '', '0af7e9c227187968d5ff67ce88143fce'),
(5664, 'en', 'WordPress', 'b1223bca091660d2cb26c4403f354ea0', '<strong>Compatible</strong> with your version of WordPress', NULL, 'LINE', NULL, 10, '', '0504fee215ff0fed5ecfe5773b388927'),
(5665, 'en', 'WordPress', '019360949341be40f9abc62e0d947806', '<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.', NULL, 'LINE', NULL, 10, '', '8abf8afe50f2bce6435d1abd2ca0c0c8'),
(5666, 'en', 'WordPress', '455ea6f84b4f4e0349d551dbb50d3a42', '<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.', NULL, 'LINE', NULL, 10, '', 'c1d528d4143f0b4bb93a78106f875896'),
(5667, 'en', 'WordPress', '72a914bd12c78373873416f57b033b13', '<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.', NULL, 'LINE', NULL, 10, '', 'df0e11da99a4daab498b8f75961d3752'),
(5668, 'en', 'WordPress', '71ce1121b4c5579d8f2c8e71335b9a22', '<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.', NULL, 'LINE', NULL, 10, '', '4d6667e15ee2ac9de68b5491c7419ba3'),
(5669, 'en', 'WordPress', 'eb233701305e7a3f2c7906f8fc65e817', '<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.', NULL, 'LINE', NULL, 10, '', '52148398cb56154506c5dfd845c54fa9'),
(5670, 'en', 'WordPress', 'f62a6b681a08721ae6b0f640c11373e9', '<strong>ERROR:</strong> There was an error connecting to the server, Please verify the settings are correct.', NULL, 'LINE', NULL, 10, '', '4010c0d3077793a02d3f92e88a3a0167'),
(5671, 'en', 'WordPress', '881815006609d34e07215728019253f8', '<strong>ERROR</strong>: Passwords may not contain the character "\\".', NULL, 'LINE', NULL, 10, '', '49836d44b0e6ace8b693e94b1c2ec723'),
(5672, 'en', 'WordPress', '7015bce91212ccb97c01670ea4114bdb', '<strong>ERROR</strong>: Please enter a nickname.', NULL, 'LINE', NULL, 10, '', '12f6d94c358b2cd6be05567384cc5509'),
(5673, 'en', 'WordPress', 'bea96aebb50c876c1a95f41c49a3f3c9', '<strong>ERROR</strong>: Please enter a password.', NULL, 'LINE', NULL, 10, '', 'cb2f3610acc308450adacfc740b6dfa3'),
(5674, 'en', 'WordPress', 'd15b5951c64392d97ca1e69fbd5d974e', '<strong>ERROR</strong>: Please enter an email address.', NULL, 'LINE', NULL, 10, '', '9c8b90da621e4473e6f1044fef4aa465'),
(5675, 'en', 'WordPress', 'ee9cd024fec5f5c83e08caabf9662327', '<strong>ERROR</strong>: Please enter the same password in both password fields.', NULL, 'LINE', NULL, 10, '', '0d59cf8265c094ee60aefef8caf65ca4'),
(5676, 'en', 'WordPress', '950fb1ad25c7df929be1e24e56a6b815', '<strong>ERROR</strong>: The email address is already used.', NULL, 'LINE', NULL, 10, '', '9697132af85f20983c6c15ac001bad9b'),
(5677, 'en', 'WordPress', '044f46e52ac3d0ba7f6b83fc33fc1b9d', '<strong>ERROR</strong>: options page not found.', NULL, 'LINE', NULL, 10, '', 'bd4c828495fe632d01f83aa5489f8961'),
(5678, 'en', 'WordPress', '0bdd62cf14b1ac2df851e97eed7faa8c', '<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.', NULL, 'LINE', NULL, 10, '', 'b9993a45905738fd64bae42ad17e351c'),
(5679, 'en', 'WordPress', '1d667c275a75b28bd9a3d3befcc8d270', '<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.', NULL, 'LINE', NULL, 10, '', '8948ea7645a7749135523ad8511f3ed9'),
(5680, 'en', 'WordPress', 'd7cb0009b8a18e9d23b53e25112dad2a', '<strong>Important:</strong> before updating, please <a href="https://codex.wordpress.org/WordPress_Backups">back up your database and files</a>. For help with updates, visit the <a href="https://codex.wordpress.org/Updating_WordPress">Updating WordPress</a> Codex page.', NULL, 'LINE', NULL, 10, '', '67698b067ae8a6f1fc66f4feee2b80c2'),
(5681, 'en', 'WordPress', 'adc736d6139e1287f1d9baaf718f5522', '<strong>Incompatible</strong> with your version of WordPress', NULL, 'LINE', NULL, 10, '', 'c22969e0bd8fcad7a01026efe6e38df2'),
(5682, 'en', 'WordPress', '1c8ad85a1a29170a2c98285371e4ac2d', '<strong>Name</strong> &mdash; The name is how it appears on your site.', NULL, 'LINE', NULL, 10, '', 'bd999297a63d3a51fec6265361bba1be'),
(5683, 'en', 'WordPress', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', NULL, 'LINE', NULL, 10, '', 'fa9350cbed043c4e20a9d539c9a36dc3'),
(5684, 'en', 'WordPress', '4ea8e185f297fa1e5706a8337719effe', '<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.', NULL, 'LINE', NULL, 10, '', 'd33f6b3b5ccf483a9b486fa7c21b2cb4'),
(5685, 'en', 'WordPress', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', NULL, 'LINE', NULL, 10, '', '3b2328772dad23a2b66fa93fca4e4ea6'),
(5686, 'en', 'WordPress', 'd1bb204120db5310aec8f2490431cb76', '<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.', NULL, 'LINE', NULL, 10, '', '9865d5aaa213f5ab960bbfa1f8c1e88a'),
(5687, 'en', 'WordPress', '91cc965a84f790ad2906d697f3119a1d', '<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.', NULL, 'LINE', NULL, 10, '', '0c2691a95e809241085027249f309fb7'),
(5688, 'en', 'WordPress', 'b807523847b38ac8553394a6e915ef62', '<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.', NULL, 'LINE', NULL, 10, '', '9e1fc137912f017bcc756ffd172f8bdc'),
(5689, 'en', 'WordPress', 'ad831971b7a4b43e2ef0d627e297902a', '<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.', NULL, 'LINE', NULL, 10, '', '26aaed1ef1fc2df5c49d95b3053be097'),
(5690, 'en', 'WordPress', '78bf51b73e62500109ff97739c24bb7d', '<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 5 most recent draft posts you\'ve started.', NULL, 'LINE', NULL, 10, '', '0c27cdc2fea26b5d85d39ba410229af3'),
(5691, 'en', 'WordPress', '099f3df0632488f2c47e2658d95e0e76', '<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.', NULL, 'LINE', NULL, 10, '', '41d4560590661787db40b2ceb73f0d60'),
(5692, 'en', 'WordPress', 'b7afe14ef93e550358d9308fbcdf9df0', '<strong>Random:</strong> Show a different image on each page.', NULL, 'LINE', NULL, 10, '', 'd0c6f56be83041237ad2ac718a30c444'),
(5693, 'en', 'WordPress', 'a98be58ec342822c43f9a60f423b1d2f', '<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.', NULL, 'LINE', NULL, 10, '', '6581b1bd63ce31bb0593db9291af7ec6'),
(5694, 'en', 'WordPress', 'd6ce148cfd01c369f1b23045e489b491', '<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.', NULL, 'LINE', NULL, 10, '', '84303f8b91428361d705300a03f526cc'),
(5695, 'en', 'WordPress', '411d40a6a21e11c47ed8adb1c92f00b0', '<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, 'LINE', NULL, 10, '', '54c95d1c7791567b1a3abf801e3f73d3'),
(5696, 'en', 'WordPress', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', NULL, 'LINE', NULL, 10, '', '1ef1bd2983e5db5c2ab49cc9f5ebe77b'),
(5697, 'en', 'WordPress', '868a7bf837c138c91e7dd266d312b71d', '<strong>The parent theme could not be found.</strong> You will need to install the parent theme, <strong>%s</strong>, before you can use this child theme.', NULL, 'LINE', NULL, 10, '', 'a8a596f39c8f8c2f83627381b4376733'),
(5698, 'en', 'WordPress', '83898cec1dbe4f4586c8347c1ba46120', '<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.', NULL, 'LINE', NULL, 10, '', '247152c7eb347ef7d22af2e392c77803'),
(5699, 'en', 'WordPress', '2d08934c32876d0e82311f1741b4e5cb', '<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.', NULL, 'LINE', NULL, 10, '', '1703b2d6967ede8a5bdc8a1e6a3ca944'),
(5700, 'en', 'WordPress', 'da5abbe81c1b1941c214b1b4298822cb', '<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.', NULL, 'LINE', NULL, 10, '', '0f057e34e6ddf43e820094c3b8c9f472'),
(5701, 'en', 'WordPress', '1ac12183049e2cd887bb8ee6b488d5fb', '<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.', NULL, 'LINE', NULL, 10, '', 'f7003b105c562b1bd495924c4feb3e7b'),
(5702, 'en', 'WordPress', '497641b5542b22dc5d6854613073ad40', '<strong>Version %1$s</strong> addressed %2$s bug.', NULL, 'LINE', NULL, 10, '', '59447b08092a558559cc3e3b77c7072c'),
(5703, 'en', 'WordPress', 'ccb459ea6dea3238d4dd526be26dba4c', '<strong>Version %1$s</strong> addressed %2$s bugs.', NULL, 'LINE', NULL, 10, '', 'f46efc2a6aeaa6bae2fbd688985af8fa'),
(5704, 'en', 'WordPress', 'df609ba9ff6d652262e61c635fd87422', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.', NULL, 'LINE', NULL, 10, '', '7ad06f8bb84d902fe02522efe5e0a8ac'),
(5705, 'en', 'WordPress', '3cd6f317f07bc2911eac401ef22b1d3b', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bugs.', NULL, 'LINE', NULL, 10, '', 'e25447ad7aae81c81ff69bfcaf5451f4'),
(5706, 'en', 'WordPress', '1a58444df6e0a3d5033b661fa156d96b', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.', NULL, 'LINE', NULL, 10, '', '1d93c4271716ffb429ffc7fd495af429'),
(5707, 'en', 'WordPress', '06235b6f29533b9b5969b12a8df162d6', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bugs.', NULL, 'LINE', NULL, 10, '', 'c9dcf18612e0fbfed3069bb728e1a2bc'),
(5708, 'en', 'WordPress', '900bc9524d36e0e13350b3400873564a', '<strong>Version %s</strong> addressed one security issue.', NULL, 'LINE', NULL, 10, '', '09c1e2652fef8b8b614e36910dba256f'),
(5709, 'en', 'WordPress', 'd237445cc6aef6932337c278ff66b5c4', '<strong>Version %s</strong> addressed some security issues.', NULL, 'LINE', NULL, 10, '', 'b24bf58b556ba5c051db80438707c429'),
(5710, 'en', 'WordPress', 'f328ed86868263a7adc2baa053255436', '<strong>Warning:</strong> Making changes to active plugins is not recommended. If your changes cause a fatal error, the plugin will be automatically deactivated.', NULL, 'LINE', NULL, 10, '', 'f04e35afc1d812668fb803604cb689bd'),
(5711, 'en', 'WordPress', 'efd1a7992bfdc84bc2343c130b45843e', '<strong>Warning:</strong> This plugin has <strong>not been marked as compatible</strong> with your version of WordPress.', NULL, 'LINE', NULL, 10, '', 'f120fde476a39adf1c8fe6b304141814'),
(5712, 'en', 'WordPress', 'fc71ed166ade2cf424a234f940aafcc7', '<strong>Warning:</strong> This plugin has <strong>not been tested</strong> with your current version of WordPress.', NULL, 'LINE', NULL, 10, '', '26dc0d46221355acbd3b020b41e80225'),
(5713, 'en', 'WordPress', '30afe4bb9e679217d99baf456b9d5040', '<strong>Warning:</strong> these pages should not be the same!', NULL, 'LINE', NULL, 10, '', 'b7503cb9d073959811fc6231671dbf89'),
(5714, 'en', 'WordPress', '949100024350856bb528b654ef53952d', '<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.', NULL, 'LINE', NULL, 10, '', '24eab8edeb2d5b1842e57128f8790d05'),
(5715, 'en', 'WordPress', '69e7c018bd2944f205fc7565fb6501b1', '<strong>WordPress News</strong> &mdash; Latest news from the official WordPress project, the <a href="https://planet.wordpress.org/">WordPress Planet</a>, and popular and recent plugins.', NULL, 'LINE', NULL, 10, '', 'a16653e3ab7ed4c13e8de96a897d87f8'),
(5716, 'en', 'WordPress', '2ba8f256b603a9a4c530acecd35d8a0a', '<strong>WordPress News</strong> &mdash; Latest news from the official WordPress project, the <a href="https://planet.wordpress.org/">WordPress Planet</a>.', NULL, 'LINE', NULL, 10, '', '0dca25bd73764b77bd5d180c7d25c13f'),
(5717, 'en', 'WordPress', '16fd34c3de2b02f60c7813d5965faecb', '<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update Now&#8221; button</strong> when you are notified that a new version is available.', NULL, 'LINE', NULL, 10, '', '83412f23107438181adad18ab3aa9678'),
