(6247, 'en', 'WordPress', 'ec3b4d4004379cce2d3894a89eb2c19a', 'For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.', NULL, 'LINE', NULL, 10, '', '692c464a82002644d39200e2e6c3ceef'),
(6248, 'en', 'WordPress', '4808b45295ba373d947b1407e34c31c7', 'For more information, see <a href="%s">the release notes</a>.', NULL, 'LINE', NULL, 10, '', '04c59a08ef60987c6b30cbb0deb1e1be'),
