(6301, 'en', 'WordPress', '620c3a0bf21d7c3a0c3823e7d80684cf', 'Hide this update', NULL, 'LINE', NULL, 10, '', '5b79bbed2f1162b929287dcca55dc110'),
(6302, 'en', 'WordPress', 'b7feca315bc97daecd520ee8864eea1f', 'Hold a comment in the queue if it contains %s or more links. (A common characteristic of comment spam is a large number of hyperlinks.)', NULL, 'LINE', NULL, 10, '', 'd90036f3e5e4e997769433540146875c'),
(6303, 'en', 'WordPress', '84b8343a7057dcab0a7c7acb6dd4862e', 'Holiday', NULL, 'LINE', NULL, 10, '', 'b1381c043d0a306acba4b943b156decf'),
