(6306, 'en', 'WordPress', '8c6da47c770c7fba0d471e56e4ea17cb', 'Hover or tap to see Activate and Live Preview buttons', NULL, 'LINE', NULL, 10, '', '34ff576dbf05a779cfbde40f11ab03b5'),
(6307, 'en', 'WordPress', '324a8e205fd6e1ed56142378c52931a8', 'Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:', NULL, 'LINE', NULL, 10, '', 'd22b06749fe9ea876f263f586e435d5f'),
(6308, 'en', 'WordPress', '40aa7c670adcc53d50a2eb0d9f434b57', 'Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:', NULL, 'LINE', NULL, 10, '', '452acedc4b5b344bf436840eca4d2c91'),
(6309, 'en', 'WordPress', '632c0917647dd5a8d9d2d13fd0a50715', 'Hovering over a row reveals action links: Edit, Delete Permanently, and View. Clicking Edit or on the media file&#8217;s name displays a simple screen to edit that individual file&#8217;s metadata. Clicking Delete Permanently will delete the file from the media library (as well as from any posts to which it is currently attached). View will take you to the display page for that file.', NULL, 'LINE', NULL, 10, '', '7f452f5a9c71165da4b96a0c7f15ca90'),
(6310, 'en', 'WordPress', 'c6701576b0781a015b3e4de713ec1078', 'How to Update', NULL, 'LINE', NULL, 10, '', '8df6ffe30318c492aeb6145853bf618a'),
(6311, 'en', 'WordPress', '83218ac34c1834c26781fe4bde918ee4', 'Welcome', NULL, 'LINE', NULL, 10, 'Howdy', 'bdab1f4b777b957588bb80a3eb1a2a4a'),
(6312, 'en', 'WordPress', 'c225085d6572d117fe4d677b76e52312', 'Howdy ###USERNAME###,\\n\\nYou recently clicked the \'Delete Site\' link on your site and filled in a\\nform on that page.\\n\\nIf you really want to delete your site, click the link below. You will not\\nbe asked to confirm again so only click this link if you are absolutely certain:\\n###URL_DELETE###\\n\\nIf you delete your site, please consider opening a new site here\\nsome time in the future! (But remember your current site and username\\nare gone forever.)\\n\\nThanks for using the site,\\nWebmaster\\n###SITE_NAME###', NULL, 'LINE', NULL, 10, '', '1fce046f5cf5bbf0263bc3a829275886'),
(6313, 'en', 'WordPress', '6ac9551847a5df4e8a6ce78dcea1ae5b', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the administration email address on\\nyour site changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, 'LINE', NULL, 10, '', 'd2c5e4658a9deab1c717ebcf04c2ed42'),
(6314, 'en', 'WordPress', 'e0af55d5dda285e1c115ed4ed9af78f9', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the email address on your account changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, 'LINE', NULL, 10, '', '5366d800ea847b305f414e3e76fdcd03'),
(6315, 'en', 'WordPress', '6df497141294a21767ee39060b813331', 'Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.', NULL, 'LINE', NULL, 10, '', 'b1d49412df4334bf9ebd3f0d3a68e7b2');
INSERT INTO `jd_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`) VALUES
(6316, 'en', 'WordPress', '44a1d89169e132b1ccc64e870b62761a', 'I\'m sorry, the link you clicked is stale. Please select another option.', NULL, 'LINE', NULL, 10, '', '4f42534cf8090c8e84588c0c508410f7'),
(6317, 'en', 'WordPress', '9b2d6dacdbdba224f9f7dc6c968ab5a3', 'I\'m sure I want to permanently disable my site, and I am aware I can never get it back or use %s again.', NULL, 'LINE', NULL, 10, '', '0a141e917d49c1371a3bf23618b45ec1'),
(6318, 'en', 'WordPress', '4a926cbb9786f9f4675219399a94117c', 'ID #%1$s: %2$s', NULL, 'LINE', NULL, 10, '', '39dc51c1a108bf619bce289b328ca089'),
(6319, 'en', 'WordPress', '9a46cd4d76954006e65738f28615c79d', 'ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>', NULL, 'LINE', NULL, 10, '', '9043dc1b7c0d0f610353e48ec3c8c512'),
(6320, 'en', 'WordPress', 'ff5fe16d2203d289d0982eb7f50bd5e4', 'ID #%1$s: %2$s <strong>The current user will not be removed.</strong>', NULL, 'LINE', NULL, 10, '', 'cf1f1d151ccf0c07ebf77bb1950dc2cf'),
(6321, 'en', 'WordPress', '32cd4224a3255dd559cd204314041be5', 'ID #%1$s: %2$s <strong>You don&#8217;t have permission to remove this user.</strong>', NULL, 'LINE', NULL, 10, '', 'f3e6392b5a3843120521d941a7b31cb2'),
(6322, 'en', 'WordPress', 'f0b044a6cf173afd1a33d8b2ccb31307', 'If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.', NULL, 'LINE', NULL, 10, '', '1dafbc0af0ec324ced79952c8e106c55'),
(6323, 'en', 'WordPress', '413ea0a127a3a100b83ec95eacabc6c3', 'If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.', NULL, 'LINE', NULL, 10, '', 'e5c0f5df9e3150bf41a78dcb4c7d8f11'),
(6324, 'en', 'WordPress', '6f363b449d599453089e76b5b75a84d2', 'If desired, WordPress will automatically alert various services of your new posts.', NULL, 'LINE', NULL, 10, '', '3d37d0e1c11d29ebee7c85a4eacb595e'),
(6325, 'en', 'WordPress', 'f729908be92047ec1a286f75adf9deac', 'If for any reason this automatic file creation doesn&#8217;t work, don&#8217;t worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.', NULL, 'LINE', NULL, 10, '', '068e6b219ff6f8dde71d1c366fcda375'),
(6326, 'en', 'WordPress', '37a24e605a3cda57698e531f125740bc', 'If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.', NULL, 'LINE', NULL, 10, '', 'e57c287dfb254367c085f6e7769a5aaf'),
(6327, 'en', 'WordPress', '1dca8bf32d5cff060d7121ae1eb92dfb', 'If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.', NULL, 'LINE', NULL, 10, '', 'e6f13ad31613faaa4df3c1a996654462'),
(6328, 'en', 'WordPress', '6d97a8f754ce990eb3882f525df23c36', 'If the link is to a person, you can specify your relationship with them using the above form. If you would like to learn more about the idea check out <a href="http://gmpg.org/xfn/">XFN</a>.', NULL, 'LINE', NULL, 10, '', 'c77ca1afbd9389b8952ae7d5c63775c0'),
(6329, 'en', 'WordPress', '331f41fc8ffd84938c48d0c356f5082a', 'If the root directory of your site were <a href="https://codex.wordpress.org/Changing_File_Permissions">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your <code>web.config</code> file. Create a new file, called <code>web.config</code> in the root directory of your site. Click in the field and press <kbd>CTRL + a</kbd> to select all. Then insert this code into the <code>web.config</code> file.', NULL, 'LINE', NULL, 10, '', 'e5e1d84f1967be472bc8bb8c657d03be'),
(6330, 'en', 'WordPress', 'd20b0e79f5524d5b219510197ef8ab8e', 'If you are looking to use the link manager, please install the <a href="%s">Link Manager</a> plugin.', NULL, 'LINE', NULL, 10, '', 'a47f761670d47765ee9d25b2701ff6ca'),
(6331, 'en', 'WordPress', 'fd4eac813576d78a40efe097d3fe7b5a', 'If you can&#8217;t drag the bookmarklet to your bookmarks, copy the following code and create a new bookmark. Paste the code into the new bookmark&#8217;s URL field.', NULL, 'LINE', NULL, 10, '', '08168e08b72e78e973e464a368e945f8'),
(6332, 'en', 'WordPress', 'ce6795178b70755466ea7df40c7b2555', 'If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.', NULL, 'LINE', NULL, 10, '', 'b8311704c5ed71d6ad51831c32f84aeb'),
(6333, 'en', 'WordPress', '916912d32e90632f29686f67c773ffc8', 'If you do not remember your credentials, you should contact your web host.', NULL, 'LINE', NULL, 10, '', '00699fbdd0613e0ed70c6623fa0b16aa'),
(6334, 'en', 'WordPress', '3cf74bde548a1b8deecb0a49d9de3784', 'If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.', NULL, 'LINE', NULL, 10, '', '95746c29c28a3b2af67a2f48088f0348'),
(6335, 'en', 'WordPress', 'c7b428708659c3c01c911d65bb3ebe23', 'If you don&#8217;t want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.', NULL, 'LINE', NULL, 10, '', '1b06181b5524acb705b752310db452b5'),
(6336, 'en', 'WordPress', '630df4be582006585fc90ce4b93f9254', 'If you don&lsquo;t want to upload your own image, you can use one of these cool headers, or show a random one.', NULL, 'LINE', NULL, 10, '', 'b2ca3b2fbe8c0a6a9b29225dc0f7815a'),
(6337, 'en', 'WordPress', '62c4541e6538f354865d8026c67d446e', 'If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.', NULL, 'LINE', NULL, 10, '', 'bf86d1c460bcc1826dd460856368310a'),
(6338, 'en', 'WordPress', '3e0109b6197e41063cfac796836f2dad', 'If you have a plugin in a .zip format, you may install it by uploading it here.', NULL, 'LINE', NULL, 10, '', 'c9aca1e00e654a26c4c29eb900b66472'),
(6339, 'en', 'WordPress', '499ba6a1e9428f7283cd1405774270d1', 'If you have a theme in a .zip format, you may install it by uploading it here.', NULL, 'LINE', NULL, 10, '', '5023a5bfda6d94cc6ac15fad30649af8'),
(6340, 'en', 'WordPress', '62f7387a9ef151c294e680b2fd42169e', 'If you have marked plugins as favorites on WordPress.org, you can browse them here.', NULL, 'LINE', NULL, 10, '', '428f30a414627fbb09bad9b806738b4a'),
(6341, 'en', 'WordPress', '7292a018caf8f27efeec3ee8fdaea12d', 'If you have marked themes as favorites on WordPress.org, you can browse them here.', NULL, 'LINE', NULL, 10, '', '1ce94c8caec9ce3a3f72516684dba0d4'),
(6342, 'en', 'WordPress', '8ba5adc334d2585a8a27cc06d82e8a3f', 'If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:', NULL, 'LINE', NULL, 10, '', '0cbaed7b4f5af6b6cbbc177778d706ad'),
(6343, 'en', 'WordPress', 'c5ecefc2c05db6570556c7385ac2e8a3', 'If you haven&#8217;t yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started', NULL, 'LINE', NULL, 10, '', 'f8acbb88fa72e7d3e7be11bbebc98e78'),
(6344, 'en', 'WordPress', 'cd1f3afe15a5cf433581cc7d084724c4', 'If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links in the upper left of the screen. These sections rotate regularly.', NULL, 'LINE', NULL, 10, '', '8d3ea645d4a47a4bf5559f66abe80775'),
(6345, 'en', 'WordPress', '4028597d6d270eedc2f36b7b7ffff224', 'If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress.org Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.', NULL, 'LINE', NULL, 10, '', 'aaa8fa84f7830ef99bab34731364acea'),
(6346, 'en', 'WordPress', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', NULL, 'LINE', NULL, 10, '', '26c90e8c2c4198236285c88921dbf771'),
(6347, 'en', 'WordPress', '4d9bf6e08479963ba39948c5f5e44ba2', 'If you need to re-install version %s, you can do so here or download the package and re-install manually:', NULL, 'LINE', NULL, 10, '', '56024e4db78fb18f54883a96b7ac73d4'),
(6348, 'en', 'WordPress', '1a89b9744e617ef3fb4ab7c4fffee90c', 'If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.', NULL, 'LINE', NULL, 10, '', 'f9729d06fe84305b8b6539dfc9744fbe'),
(6349, 'en', 'WordPress', '97b78ef138769a3fcf7e03efeafe2005', 'If you reach out to us, we\'ll also ensure you\'ll never have this problem again.', NULL, 'LINE', NULL, 10, '', '4134522c953314092e5285efe9bf88a3'),
(6350, 'en', 'WordPress', 'b1547fa31c5744e25be92a64e7f77beb', 'If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.', NULL, 'LINE', NULL, 10, '', '0d2ce200784ae6cfa94ecdee45ab50e1'),
(6351, 'en', 'WordPress', '52dbfd8940540e8905425b1563aa00e8', 'If you take over, %s will be blocked from continuing to edit.', NULL, 'LINE', NULL, 10, '', '08c457bb69f16075e9f68797d32dea2e'),
(6352, 'en', 'WordPress', 'c30a3f2562ba86359d76a45f582a273e', 'If you temporarily make your <code>web.config</code> file writable for us to generate rewrite rules automatically, do not forget to revert the permissions after rule has been saved.', NULL, 'LINE', NULL, 10, '', '5854d0dcd910468c85bceb7048bbed38'),
(6353, 'en', 'WordPress', '80b39fd224faa25435de8fa53171bd8d', 'If you temporarily make your site&#8217;s root directory writable for us to generate the <code>web.config</code> file automatically, do not forget to revert the permissions after the file has been created.', NULL, 'LINE', NULL, 10, '', '48bed6bc3896f6e0ea2eda6fad568f32'),
(6354, 'en', 'WordPress', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', NULL, 'LINE', NULL, 10, '', '6939bbe061b0682e3ff5e0ec6fe94466'),
(6355, 'en', 'WordPress', 'e8953b095643b4bf6a1cd0bae7a85508', 'If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.', NULL, 'LINE', NULL, 10, '', 'dc650f35af2988de19f773ef456f668e'),
(6356, 'en', 'WordPress', '73f8043db3273ea6f2702ae2121b3772', 'If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload link in the upper left. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.', NULL, 'LINE', NULL, 10, '', 'd9a5906c3a69fcdd9822a5640e549e49'),
(6357, 'en', 'WordPress', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, 'LINE', NULL, 10, '', '8418479033fde10c3f4d90258c22d03d'),
(6358, 'en', 'WordPress', 'fc276f47f9e88e53fb9a81e0e683a057', 'If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.', NULL, 'LINE', NULL, 10, '', '24c15cb4616901876d61919c56be3ec4'),
(6359, 'en', 'WordPress', 'b54fa9afe2dc888d8a5c71cc1b61b51c', 'If you want to run multiple WordPress installations in a single database, change this.', NULL, 'LINE', NULL, 10, '', 'ca518d4dddc2e42edc91658cab8a8fcb'),
(6360, 'en', 'WordPress', 'ad855ec295e859c1edeb1e1a147bea42', 'If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s" target="_blank">WordPress.org Theme Directory</a>. Themes in the WordPress.org Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, 'LINE', NULL, 10, '', '176aa1819d32abf53f89fd28ed4eb9bf'),
(6361, 'en', 'WordPress', '54ca6413c3e79dbdd28d238d31292f36', 'If your <code>.htaccess</code> file were <a href="https://codex.wordpress.org/Changing_File_Permissions">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your <code>.htaccess</code> file. Click in the field and press <kbd>CTRL + a</kbd> to select all.', NULL, 'LINE', NULL, 10, '', '1843545e172f40a097e9cac4949dd386'),
(6362, 'en', 'WordPress', '9de4085d7001cc05560aaee93f1ab7b2', 'If your <code>web.config</code> file were <a href="https://codex.wordpress.org/Changing_File_Permissions">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your <code>web.config</code> file. Click in the field and press <kbd>CTRL + a</kbd> to select all. Then insert this rule inside of the <code>/&lt;configuration&gt;/&lt;system.webServer&gt;/&lt;rewrite&gt;/&lt;rules&gt;</code> element in <code>web.config</code> file.', NULL, 'LINE', NULL, 10, '', 'eab48c09f1d0ee5a7851059f88c6de2a'),
(6363, 'en', 'WordPress', 'ae4333ffddf970f98ea2387193cc0f5b', 'If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.', NULL, 'LINE', NULL, 10, '', '64b189d73ea4119fb9114248650c1d60'),
