(6386, 'en', 'WordPress', '911b598e98c0d31c7e5bdfd6e1136dbc', 'In all likelihood, these items were supplied to you by your Web Host. If you don&#8217;t have this information, then you will need to contact them before you can continue. If you&#8217;re all ready&hellip;', NULL, 'LINE', NULL, 10, '', 'e60b676797458afa4a010ad68b7f2e56'),
(6387, 'en', 'WordPress', '72247007ca8dd9d5b747cd2d13855ae4', 'In most cases, WordPress will automatically apply maintenance and security updates in the background for you.', NULL, 'LINE', NULL, 10, '', '6714c34437800636fa052700a16285f1'),
(6388, 'en', 'WordPress', '0278248c794c7dd11a47837d5861ee71', 'In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.', NULL, 'LINE', NULL, 10, '', '6efcde1f8b68eee081fd34ab86433a38'),
(6389, 'en', 'WordPress', '5c43aa88fc70f0b190b05aafdc6ba900', 'In reply to %s.', NULL, 'LINE', NULL, 10, '', '0fffc89258e9d1a5f83be4090642ab00'),
(6390, 'en', 'WordPress', '69321db1494e9c628339738471d30cd6', 'In reply to: %s', NULL, 'LINE', NULL, 10, '', 'a917eb7980be4d0378bb9fa3c4c60844'),
(6391, 'en', 'WordPress', 'd32e65d44fb05ccf2bed3709f468c87c', 'In response to: %s', NULL, 'LINE', NULL, 10, '', 'ef551ce5e5b7ccaaa8e8c6d7cadcd540'),
(6392, 'en', 'WordPress', 'ddfa3b051bb82c9c70d438b8e5871308', 'In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.', NULL, 'LINE', NULL, 10, '', '41d999127d027547f0cfbe4f0a1c0a13'),
(6393, 'en', 'WordPress', '78516f0126f95864e9dd3d48b6d7504f', 'In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.', NULL, 'LINE', NULL, 10, '', 'dff67e64ed9a14033a82f277980f3a19'),
(6394, 'en', 'WordPress', '6d7053230d152b1bbde8e0e11985e6cd', 'In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.', NULL, 'LINE', NULL, 10, '', 'e990919f024779ae02b49adac7120a64'),
(6395, 'en', 'WordPress', '75a9d96583454bb73d919516b14c1020', 'In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.', NULL, 'LINE', NULL, 10, '', '52638b6b1a7b9b153a5d0047fc87970a'),
(6396, 'en', 'WordPress', 'a1e79989a368fffa040f3724cb25bb0a', 'In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', NULL, 'LINE', NULL, 10, '', 'fb48e1b82ad98a90607467b7139a21d4'),
(6397, 'en', 'WordPress', '398a09b4f2a68fcc14e71e5338621c16', 'In the editing area the Tab key enters a tab character. To move below this area by pressing Tab, press the Esc key followed by the Tab key. In some cases the Esc key will need to be pressed twice before the Tab key will allow you to continue.', NULL, 'LINE', NULL, 10, '', 'd767abef4fd9cd1f5d7232c5c6d0484a'),
(6398, 'en', 'WordPress', '1da0f24e118e98984a0dddbce260a839', 'Inactive <span class="count">(%s)</span>', NULL, 'LINE', NULL, 10, '', '08b2036ef1c649ecaed2efc779c5cb3c'),
