(6646, 'en', 'WordPress', 'e45bfeb9fa95a202319d55f3ba06991b', 'On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.', NULL, 'LINE', NULL, 10, '', 'c20478e0af5a79f925a9d081bb31d0c2'),
