(6650, 'en', 'WordPress', '02a05f8200d69abd63a62fb16bc7404f', 'Once you hit &#8220;Confirm Deletion&#8221;, the user will be permanently removed.', NULL, 'LINE', NULL, 10, '', 'f5282624258b43d6672d64ade47df98a'),
