(6689, 'en', 'WordPress', 'cf58d0bdb1a7290be283d6eecf7ae494', 'Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.', NULL, 'LINE', NULL, 10, '', 'ed3cec48f035ee3b0637714ea99b6869'),
(6690, 'en', 'WordPress', '80eb21ed1fac7886258fd1da7c3268bc', 'Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.', NULL, 'LINE', NULL, 10, '', '91ffa8d1260c612fbb16edaffc047319'),
