(7053, 'en', 'WordPress', '999790af91e92512b7b4c1821587f790', 'The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;', NULL, 'LINE', NULL, 10, '', 'c8927a81fa207fe63d90d3f6156f7184'),
(7054, 'en', 'WordPress', 'ae058500b5a459f6b34ab30679f8f5d7', 'The %s constant in your %s file is no longer needed.', NULL, 'LINE', NULL, 10, '', '009383d8d12d9a8efc0b0bc70b33ad08'),
(7055, 'en', 'WordPress', 'b2a2f4dea574fcbabeb1962561d1ff2a', 'The %s importer is invalid or is not installed.', NULL, 'LINE', NULL, 10, '', 'e58190bfeaaf423a6ec7ee076a69074d'),
(7056, 'en', 'WordPress', '3ca8be7ee91813ff2464fb01340d6b6e', 'The %s setting is unregistered. Unregistered settings are deprecated. See https://codex.wordpress.org/Settings_API', NULL, 'LINE', NULL, 10, '', '9b35c43590305bff989c75cd7459fd10'),
(7057, 'en', 'WordPress', '5ec28895290332887fc333d6c2370a11', 'The %s stylesheet doesn&#8217;t contain a valid theme header.', NULL, 'LINE', NULL, 10, '', '8b2d17b59de25f77f39b71ed1343df02'),
(7058, 'en', 'WordPress', '77aba6400a12368a3c8e1d29765352b2', 'The %s table is already optimized.', NULL, 'LINE', NULL, 10, '', '3a70a93eb68e4bb19ab98252328a54cb'),
(7059, 'en', 'WordPress', '744a1d8f5bfbd4c6d90923b7087343f7', 'The %s table is okay.', NULL, 'LINE', NULL, 10, '', '320a1ec96df217215adcc3cefc80997b'),
(7060, 'en', 'WordPress', 'e0433c8fccacdcc1dec538d01a5ffb07', 'The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, 'LINE', NULL, 10, '', '7fe081dea07be815b15c157c11f5ac6c'),
(7061, 'en', 'WordPress', 'b30e060516ec005fae3a7bedfef38b28', 'The <a href="https://codex.wordpress.org/Glossary#Character_set">character encoding</a> of your site (UTF-8 is recommended)', NULL, 'LINE', NULL, 10, '', '7c610cb91acb7e2cb1b342cf050ea8e7'),
(7062, 'en', 'WordPress', '554b7ac84f1fa573ee1867a3a2c02d09', 'The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.', NULL, 'LINE', NULL, 10, '', '18191a0d9f31bbe9129eb45fd3351ebf'),
(7063, 'en', 'WordPress', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, 'LINE', NULL, 10, '', 'b4e92891d9a55eeb4ffae864084d89d3'),
(7064, 'en', 'WordPress', '42df955609d871023a666cc9f4519509', 'The Customizer allows you to preview changes to your site before publishing them. You can also navigate to different pages on your site to preview them.', NULL, 'LINE', NULL, 10, '', '35bd58cd2551636166a29e608cbd045a'),
(7065, 'en', 'WordPress', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, 'LINE', NULL, 10, '', '7431c96266fb9cfbf4f660d643b44d87'),
(7066, 'en', 'WordPress', 'e3a6c830a45973f8caac3432d436e903', 'The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.', NULL, 'LINE', NULL, 10, '', '2edf157480afd6fec118fd0b33c56e64'),
(7067, 'en', 'WordPress', '2bc6f983917576292a23bcbf9c5ecf74', 'The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.', NULL, 'LINE', NULL, 10, '', '2204592dd9839c2e4c0835fcdf5999ac'),
(7068, 'en', 'WordPress', '6dc0393203c32f220edccfb86e01b3fa', 'The Twenty Fifteen and Twenty Sixteen themes have been updated to support custom logos, which can be found in the Site Identity section of the customizer.', NULL, 'LINE', NULL, 10, '', 'ed3d0a0b4695377fa067e1538d292eff'),
(7069, 'en', 'WordPress', 'fa7710958d9308b31dfb35c7cd561c36', 'The Walker class named %s does not exist.', NULL, 'LINE', NULL, 10, '', 'f82cfee99f10e749d554810e1cf107a9'),
(7070, 'en', 'WordPress', '002b9dd3a4beb56d4092b6848925ba55', 'The WordPress Team', NULL, 'LINE', NULL, 10, '', 'd67b49d01a6cf2e039512a916b3b7d37'),
(7071, 'en', 'WordPress', '68804ce6aa38ab1ef7d4e33889033f7b', 'The WordPress URL and the Site URL can be the same (example.com) or different; for example, having the WordPress core files (example.com/wordpress) in a subdirectory instead of the root directory.', NULL, 'LINE', NULL, 10, '', '39a496e4dbb8b5710aed3fc4f40c36d8'),
(7072, 'en', 'WordPress', 'be7027f369951f13e70f11596d6f5328', 'The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.', NULL, 'LINE', NULL, 10, '', '8b2cf23f4315588714d12f5d6faaabbe'),
(7073, 'en', 'WordPress', '462d9bb1638287143d47e551f189f362', 'The active theme is broken. Reverting to the default theme.', NULL, 'LINE', NULL, 10, '', 'ae7b1bacb242eb259c49c94ad0262ac7'),
(7074, 'en', 'WordPress', '0d6e6952823baa88591bf01e4b2a7d9f', 'The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.', NULL, 'LINE', NULL, 10, '', '1248a0907975aae03bc531481cc43c3d'),
(7075, 'en', 'WordPress', '61b6cf804dc77479ab0d352e1a3a7680', 'The backup of this post in your browser is different from the version below.', NULL, 'LINE', NULL, 10, '', 'fc08ca4804ef3c2e11662376427af06f'),
(7076, 'en', 'WordPress', 'ea7e6216c8e195c3ee86ef1f9a50b954', 'The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you don&#8217;t use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.', NULL, 'LINE', NULL, 10, '', 'f1f0e43988a5b6a329d5ca07226cdce0'),
(7077, 'en', 'WordPress', '7ab07ba8c965ea3d313a005f2b1be7e1', 'The boxes on your Dashboard screen are:', NULL, 'LINE', NULL, 10, '', 'c7246fb8aeb33acf398875f6eaf7cf3b'),
(7078, 'en', 'WordPress', '410c599c85788193747c0388bcfad648', 'The checksum of the file (%1$s) does not match the expected checksum value (%2$s).', NULL, 'LINE', NULL, 10, '', 'db2596f2e08789706ee7092b7cc91891'),
(7079, 'en', 'WordPress', '1c76d426685053d54d636e0fb98a2dff', 'The constant %s cannot be defined when installing WordPress.', NULL, 'LINE', NULL, 10, '', 'af54c8cb413d0185b2c086b5080d32b1'),
(7080, 'en', 'WordPress', '374c3cac97bc640a934978d1331acfa3', 'The current theme does not support a flexible sized header image.', NULL, 'LINE', NULL, 10, '', 'cc4d4930a8a771d20ff037bfdfc9200d'),
(7081, 'en', 'WordPress', '7c57eab042e554704070a118e5c1b5df', 'The current theme does not support uploading a custom header image.', NULL, 'LINE', NULL, 10, '', 'a05405b5e4023336b9c044485fc7e431'),
(7082, 'en', 'WordPress', 'dd3258e965aab5f73100334a65e08673', 'The current theme is displayed highlighted as the first theme.', NULL, 'LINE', NULL, 10, '', '39a848e3695031e22e26bc453d0f03b5'),
(7083, 'en', 'WordPress', '2f18c4df25d95c2e09c53e122b7cfaba', 'The current user&#8217;s role must have user editing capabilities.', NULL, 'LINE', NULL, 10, '', '8e44c825b01eb751354693bb33e2dfd6'),
(7084, 'en', 'WordPress', '072bf929078e95a54331ce64b7c80f4f', 'The customizer now supports a <a href="%s">comprehensive framework</a> for rendering parts of the preview without rewriting your PHP code in JavaScript.', NULL, 'LINE', NULL, 10, '', '2f83bef24c6ba79c016595e141a7f4d1'),
(7085, 'en', 'WordPress', '5602c5c8e3e0c5a5f08b56faa4f3e32d', 'The database update process may take a little while, so please be patient.', NULL, 'LINE', NULL, 10, '', '4c36dabd932ab02361af71c7473fd71a'),
(7086, 'en', 'WordPress', 'f5b712b9d301f61dd92249263ecc1e6a', 'The description is not prominent by default; however, some themes may show it.', NULL, 'LINE', NULL, 10, '', 'db338467e14bb45968a0d119170517d3'),
(7087, 'en', 'WordPress', '1283a7fcac8dc097b0875b6a7290af01', 'The fields on this screen determine some of the basics of your site setup.', NULL, 'LINE', NULL, 10, '', '383f724567d18a1130399d9c7fa3969c'),
(7088, 'en', 'WordPress', '9c9d7cc777f55833e36dc7e4a82a2895', 'The file \'wp-config.php\' already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href=\'%s\'>installing now</a>.', NULL, 'LINE', NULL, 10, '', '2ab6f6a1c1d0314ff914f377d2868ba2'),
(7089, 'en', 'WordPress', '0d62c1952f10d94dc85ac41c2cf66b93', 'The file \'wp-config.php\' already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href=\'%s\'>installing now</a>.', NULL, 'LINE', NULL, 10, '', 'ab8c7d8d7ac024ed141e93918bf32e1c'),
(7090, 'en', 'WordPress', 'eb7630ff98db1781ebbdfbd123dedce6', 'The following plugins failed to update:', NULL, 'LINE', NULL, 10, '', '90cba2347754f6cf15f82e315015554f'),
(7091, 'en', 'WordPress', '689596503b47d95e2f38d5a124123f6e', 'The following plugins have new versions available. Check the ones you want to update and then click &#8220;Update Plugins&#8221;.', NULL, 'LINE', NULL, 10, '', 'e71c67efb3ece33d4d4233aff4ce1726'),
(7092, 'en', 'WordPress', 'bb704e5e27f70084d643a9b1738a3eae', 'The following plugins were successfully updated:', NULL, 'LINE', NULL, 10, '', 'e9c0fd8b1802f3dc2a845ec393acbf02'),
