(7099, 'en', 'WordPress', '973b73930e6d5cde61e00edba9ff297e', 'The ftp PHP extension is not available', NULL, 'LINE', NULL, 10, '', '7d636298d8a3715dfb1c42ef7b46e287'),
(7100, 'en', 'WordPress', '7541f87234c78f5151d30d900471192f', 'The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.', NULL, 'LINE', NULL, 10, '', '081e23f10ecdf9cf9b1173c9be027cbb'),
(7101, 'en', 'WordPress', '4ad646193bb62729c1c619f14089b2ba', 'The installer attempted to contact a random hostname (%s) on your domain.', NULL, 'LINE', NULL, 10, '', '24bb1ecfb201a15c66e5ca898328d9f9'),
