(7104, 'en', 'WordPress', '882806669603d5894215807206242b6f', 'The language pack is missing either the %1$s or %2$s files.', NULL, 'LINE', NULL, 10, '', '6251acf17f5ab29e18e875620735d286'),
(7105, 'en', 'WordPress', '030eb735ca4d9aed22505e6adb6e37c1', 'The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.', NULL, 'LINE', NULL, 10, '', '9b0e57f000ea50569368aef51e2a0b60'),
(7106, 'en', 'WordPress', '6cd5563003ed28586594ce0fd5f3aad5', 'The menu has been successfully deleted.', NULL, 'LINE', NULL, 10, '', '4a4a1573a956ca454d72af7bd0e9b22c'),
(7107, 'en', 'WordPress', '692aab9220484ce95afd7ad0fb7b5d35', 'The menu item has been successfully deleted.', NULL, 'LINE', NULL, 10, '', 'a31bef93c1361dfc10a7fd143e3fc166'),
(7108, 'en', 'WordPress', '076cce8a4cea590d426b0a923e9c6f21', 'The menu management box at the top of the screen is used to control which menu is opened in the editor below.', NULL, 'LINE', NULL, 10, '', '0b2479369649645c412e7e0b82dff6be'),
(7109, 'en', 'WordPress', 'ce89baf758fa73e4ac7cf631cedb6c27', 'The miscellaneous options group has been removed. Use another settings group.', NULL, 'LINE', NULL, 10, '', '04d9349d8b2e3b2a70a48534ca211aeb'),
(7110, 'en', 'WordPress', '43ab2e43cb438622dc97eff81b7efa46', 'The name is how it appears on your site.', NULL, 'LINE', NULL, 10, '', 'afd55d5f97bfd64032b4fe42b016b0b0'),
(7111, 'en', 'WordPress', 'b9a11c204f9dbab66a8dc53655eada32', 'The name of the database you want to use with WordPress.', NULL, 'LINE', NULL, 10, '', '26adeb7a3b75e112c7e8cd4511107f14'),
(7112, 'en', 'WordPress', 'abc81921b5497a4ae0a9f1d76c6d931f', 'The network already exists.', NULL, 'LINE', NULL, 10, '', '355ac8d4193ffe972f2b586c4af35b23'),
(7113, 'en', 'WordPress', '45cd9856d566986addee9fc589d71b76', 'The package contains no files.', NULL, 'LINE', NULL, 10, '', '768a243857d49ed25b4c91c2bbcadd1e'),
(7114, 'en', 'WordPress', '83fa7e6e72d97bf56a513274fdd9a277', 'The package could not be installed.', NULL, 'LINE', NULL, 10, '', 'ff8e3766241c292de7a3e8fdfe0412b0'),
(7115, 'en', 'WordPress', 'c76de7cd4fb040ef8325dd13a78b6d02', 'The parent theme, <strong>%1$s %2$s</strong>, is currently installed.', NULL, 'LINE', NULL, 10, '', 'c31bd994a65c65982da5cd47959458ff'),
(7116, 'en', 'WordPress', '09b21bc23c8de2abb04123a66a529c17', 'The password you chose during the install.', NULL, 'LINE', NULL, 10, '', '054e6b9e595fe0278e97511e0111ba47'),
(7117, 'en', 'WordPress', 'b9ba49ca35776f8a4f65caee6c1afbef', 'The plugin %1$s has been <strong>deactivated</strong> due to an error: %2$s', NULL, 'LINE', NULL, 10, '', '6b374e8d8d94e057bed978f2e2138a49'),
(7118, 'en', 'WordPress', 'e0507116ce6ea87713a4ad0f6227e927', 'The plugin contains no files.', NULL, 'LINE', NULL, 10, '', '18162fa1466cc6a4ad5ac4d988bb362b'),
(7119, 'en', 'WordPress', '9442b248b713240174c9a43136739a1d', 'The plugin does not have a valid header.', NULL, 'LINE', NULL, 10, '', 'bfd0744cc109da1c6ff4a9b761778710'),
(7120, 'en', 'WordPress', 'cd7fb4b77f5f570908610dfff4986475', 'The plugin generated %d characters of <strong>unexpected output</strong> during activation. If you notice &#8220;headers already sent&#8221; messages, problems with syndication feeds or other issues, try deactivating or removing this plugin.', NULL, 'LINE', NULL, 10, '', '2340dc46b06de1dd340d70c012f66918'),
(7121, 'en', 'WordPress', '1a4d90b7180c829ea35c6fb784d19d51', 'The plugin generated unexpected output.', NULL, 'LINE', NULL, 10, '', '2ab8129f2d18ad65f67292fb9593a3bf'),
(7122, 'en', 'WordPress', '84dc148de4d2e1fd94436ff69888e6c6', 'The plugin is at the latest version.', NULL, 'LINE', NULL, 10, '', '702c229ca6a20d2157daf7e5724b649f'),
(7123, 'en', 'WordPress', 'c274fd8b4d03b84ef1a32b59a7d6e35f', 'The primary site you chose does not exist.', NULL, 'LINE', NULL, 10, '', 'b6df996388089758f97af3a94bf2912d'),
(7124, 'en', 'WordPress', '3d811fcccd844c1162fb6c483860e6e4', 'The privacy options group has been removed. Use another settings group.', NULL, 'LINE', NULL, 10, '', 'd870739a4707657df6a81239f2f57d0f'),
(7125, 'en', 'WordPress', 'c5a4e15efc46e23f0bf0695ec14433b4', 'The search for installed themes will search for terms in their name, description, author, or tag.', NULL, 'LINE', NULL, 10, '', '573b525ade8d419ca7c1df404485a3aa'),
(7126, 'en', 'WordPress', '6885571838d162bf8caab9a1ae853663', 'The selected plugin has been <strong>deleted</strong>.', NULL, 'LINE', NULL, 10, '', '10ac847e969e0c78610520d6593d7232'),
(7127, 'en', 'WordPress', '31fcf8abc0755a9ce74203d7b7bf779b', 'The selected plugins have been <strong>deleted</strong>.', NULL, 'LINE', NULL, 10, '', '12fbc87883a0552f455778b367718444'),
(7128, 'en', 'WordPress', '4c4f2a76891b1d1153e75e096b441c6c', 'The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.', NULL, 'LINE', NULL, 10, '', '5d946a8f904baf8b0d1d21b0b79dc6bb'),
(7129, 'en', 'WordPress', 'dfb0679388e6a66905374102a1d4157b', 'The ssh2 PHP extension is available, however, we require the PHP5 function %s', NULL, 'LINE', NULL, 10, '', 'd167a140b6ea5da0c4c2d728083d28cf'),
(7130, 'en', 'WordPress', '218258d09f39bcbf45b4a647b12e5c78', 'The ssh2 PHP extension is not available', NULL, 'LINE', NULL, 10, '', '03e5a97e654a39552b633f8f26050c43'),
(7131, 'en', 'WordPress', '662d392e9c4877e172207a5baea4a8d8', 'The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Save &amp; Activate button above the menu.', NULL, 'LINE', NULL, 10, '', 'fd029ffd566b0b9fac07b41f9c054796'),
(7132, 'en', 'WordPress', '01b08bbf98e543a3a47855751c0d9e98', 'The theme contains no files.', NULL, 'LINE', NULL, 10, '', 'be21f9f53a079731ab936b713a456c84'),
(7133, 'en', 'WordPress', '6557962c2f31513e3f7f5f2de69ab61d', 'The theme is at the latest version.', NULL, 'LINE', NULL, 10, '', '952a799a3667f5bbb6df9fbf5ec5ecdb'),
(7134, 'en', 'WordPress', '3237265583af359a08fbed2b7a9ef8d9', 'The theme is missing the %s file.', NULL, 'LINE', NULL, 10, '', '81205441e6c576fc1e5c1d31d70711fd'),
