INSERT INTO `jd_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`) VALUES
(7136, 'en', 'WordPress', 'fb8a689f09c8b89aafe92bdf6581af71', 'The theme you are currently using isn&#8217;t widget-aware, meaning that it has no sidebars that you are able to change. For information on making your theme widget-aware, please <a href="https://codex.wordpress.org/Widgetizing_Themes">follow these instructions</a>.', NULL, 'LINE', NULL, 10, '', '538e25d95a3eb97953326158331da31a'),
(7137, 'en', 'WordPress', '4388af50e061814a34b6819900fa73bd', 'The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.', NULL, 'LINE', NULL, 10, '', '2fa52e2b37b45aa896c8150e3768e7ca'),
(7138, 'en', 'WordPress', 'ba709deabd9282eea06ad1183ca8ae10', 'The translation is up to date.', NULL, 'LINE', NULL, 10, '', 'b631e3b04d4399d4377546a2147d776d'),
