(7224, 'en', 'WordPress', '0dd321bd7f02eee4f60ac86a9a88d911', 'This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.', NULL, 'LINE', NULL, 10, '', '8fe8173ddf69f3785faac7cdbaa1927f'),
(7225, 'en', 'WordPress', '068c739ac399f0571399749cd8ef64a2', 'This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.', NULL, 'LINE', NULL, 10, '', '657020e43e54562ad6058641597c67ad'),
(7226, 'en', 'WordPress', '464d5d037322535a4c893493d728183f', 'This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.', NULL, 'LINE', NULL, 10, '', '81e6f61914ca3f714676009947e36d0f'),
