(7256, 'en', 'WordPress', '893614bd345b053ce4ed809117822ce6', 'To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location', NULL, 'LINE', NULL, 10, '', '5198df06d46daf01496db726d99cc214'),
(7257, 'en', 'WordPress', 'd93444b6125d6f7511ed541f8ea2b16f', 'To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.', NULL, 'LINE', NULL, 10, '', '9fb0052feeb07f15bbb5c2f82c3627e2'),
