(7259, 'en', 'WordPress', 'dd6860aaf005fba9c4e6c0d0437adb8a', 'To allow use of this page to automatically repair database problems, please add the following line to your <code>wp-config.php</code> file. Once this line is added to your config, reload this page.', NULL, 'LINE', NULL, 10, '', '490530a033a15e9e602aa0f2b0b58ac5'),
(7260, 'en', 'WordPress', 'b2ee790e1c8acee20705c7f91fd61181', 'To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s drop down.</strong> When you&#8217;re finished, <strong>click Save Changes</strong>', NULL, 'LINE', NULL, 10, '', '0f44b8071191018b79b7ad7e47b49f04'),
