(7263, 'en', 'WordPress', 'e04eb96141dc379051c2d45c21baf2d7', 'To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>', NULL, 'LINE', NULL, 10, '', 'd009af539806e4059abb1e2e6154d3a3'),
