(7265, 'en', 'WordPress', 'bc87173cbdcea8f7d6785a2b98c18a07', 'To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.', NULL, 'LINE', NULL, 10, '', 'c7437fff536ce43b16a7c8bbcf503e8d'),
(7266, 'en', 'WordPress', '023edac785db22df95123ca624d14034', 'To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.', NULL, 'LINE', NULL, 10, '', '26e66bad8791ecbadac7c8bf49c82ca7'),
