(7268, 'en', 'WordPress', 'cb7a480a4f0110c051a8c21c4d34ba1c', 'To post to WordPress by email you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: <kbd>%s</kbd>, <kbd>%s</kbd>, <kbd>%s</kbd>.', NULL, 'LINE', NULL, 10, '', 'c3983b7a6287c6b589127ba4323f191a'),
(7269, 'en', 'WordPress', '273ac586f8c89c098004a170ce915f8b', 'To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu', NULL, 'LINE', NULL, 10, '', '9288ca09283c97d0dc08ef5aa3f7c136'),
