(7272, 'en', 'WordPress', 'b5f53d7f307b7ddcbbac8315d4ed8790', 'To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.', NULL, 'LINE', NULL, 10, '', 'f4769ab23bab29a3a0f788d5de8abbce'),
(7273, 'en', 'WordPress', 'e51c94c86c384530e3ad332d097b6603', 'To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.', NULL, 'LINE', NULL, 10, '', '300a869bd23749e33627237693147dcb'),
