(7446, 'en', 'WordPress', '6271c2bddf9d5cd62fe0d0d5138e0372', 'Welcome to WordPress. Before getting started, we need some information on the database. You will need to know the following items before proceeding.', NULL, 'LINE', NULL, 10, '', '28d4bc7e479c25d02da11b1c99fb1f56'),
