(7448, 'en', 'WordPress', '1edbf8934455e35e01018196f1aa0a7f', 'Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.', NULL, 'LINE', NULL, 10, '', '01ff125e325994f87407fbb877f19dfc'),
(7449, 'en', 'WordPress', '3eeaa8e4fefe9c5040b17396141f97cf', 'Welcome to your WordPress Dashboard! This is the screen you will see when you log in to your site, and gives you access to all the site management features of WordPress. You can get help for any screen by clicking the Help tab in the upper corner.', NULL, 'LINE', NULL, 10, '', 'e3748a85769e816d1bd51af4d681cfca'),
