(7455, 'en', 'WordPress', 'a898fa08a0cadfff38577d1a8d36312d', 'What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.', NULL, 'LINE', NULL, 10, '', '8b7da9206f4d7a543becb9c1a79a1cea'),
(7456, 'en', 'WordPress', '521ea8609b1a8c3afb4d6301771669a1', 'When a comment contains any of these words in its content, name, URL, email, or IP, it will be held in the <a href="edit-comments.php?comment_status=moderated">moderation queue</a>. One word or IP per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, 'LINE', NULL, 10, '', '9213a973e236089874ed729f255a7e99'),
(7457, 'en', 'WordPress', '6ec09b6608d5907ba07e8561c41770fb', 'When a comment contains any of these words in its content, name, URL, email, or IP, it will be put in the trash. One word or IP per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, 'LINE', NULL, 10, '', '63bb665b54fe802082b4a122cfed9aa2'),
(7458, 'en', 'WordPress', '16eb38b0466b758e83ffc1afb65bc986', 'When adding a new category on this screen, you&#8217;ll fill in the following fields:', NULL, 'LINE', NULL, 10, '', '2ac546db227a8520cc4c1b18b9c68407'),
(7459, 'en', 'WordPress', '370c15874bf89814187701866c485c9e', 'When adding a new tag on this screen, you&#8217;ll fill in the following fields:', NULL, 'LINE', NULL, 10, '', 'b82bcad37b917634e8bf49ba605559a2'),
(7460, 'en', 'WordPress', '7703983ef109c52a423492c4bfa5ffbe', 'When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.', NULL, 'LINE', NULL, 10, '', 'c2ee303a3571c6bc204b16f44fd2d038'),
(7461, 'en', 'WordPress', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, 'LINE', NULL, 10, '', 'f42216d3b2a1160fb46046072654fcc2'),
(7462, 'en', 'WordPress', '4210a86ca0a86ebdf5712c60c47a01ca', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.', NULL, 'LINE', NULL, 10, '', 'c0530f10c7e06b7c2eb43f56d5f90e39'),
(7463, 'en', 'WordPress', '4fd5e879927f19de076cca45bc59434a', 'When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.', NULL, 'LINE', NULL, 10, '', '47257322020fa8ed290376c5bc0dc086'),
(7464, 'en', 'WordPress', 'cd8d1a19831be7da0547b6a5fcf33156', 'When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.', NULL, 'LINE', NULL, 10, '', '5822d84912fb4a49245330e5ce496cad'),
(7465, 'en', 'WordPress', '2a668b1b4a5c8a0d7d6ccc363cf266a7', 'When you click the button below WordPress will create an XML file for you to save to your computer.', NULL, 'LINE', NULL, 10, '', '998d48ffd49cd85deb259d9612a7d1ad'),
(7466, 'en', 'WordPress', '4019e2a8e686944d35a3d7f6fe33818f', 'When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see <a href="https://codex.wordpress.org/Update_Services">Update Services</a> on the Codex. Separate multiple service URLs with line breaks.', NULL, 'LINE', NULL, 10, '', 'f0621f2e8a8e5bb74d5b6027820bf884'),
(7467, 'en', 'WordPress', 'a038eafad9e01988c1841de565372b3d', 'While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.', NULL, 'LINE', NULL, 10, '', '3955e66f69ac92acadc3531e58f469d3'),
(7468, 'en', 'WordPress', '4164b9aab2478e48463a5e400b5918b3', 'While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, your site will return to normal.', NULL, 'LINE', NULL, 10, '', '66c31ce01caa6cac7c704a505849cb26'),
(7469, 'en', 'WordPress', '25a81701fbfa4a1efdf660a950c1d006', 'White', NULL, 'LINE', NULL, 10, '', '77bd6ecb5fc4d3f39bc7d4f2131a0c72'),
