(7471, 'en', 'WordPress', '5f71bda8d746f5a38f8be090639b5e2f', 'Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.', NULL, 'LINE', NULL, 10, '', 'afdcfe39d626a2071630f96c72ef2042'),
(7472, 'en', 'WordPress', '2a1b56a60634250cd6cf205c74ed00c6', 'Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.', NULL, 'LINE', NULL, 10, '', '833b5a7f3612b5f133dec5d99631a34c'),
(7473, 'en', 'WordPress', '2dcde0b29a51130f79f23dee3acbe2ed', 'Word count: %s', NULL, 'LINE', NULL, 10, '', 'deffe9273122e58ec8f7d0f35e0e62c2'),
