(7484, 'en', 'WordPress', '33c13135df9264a73a6958ca2ae370f5', 'WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.', NULL, 'LINE', NULL, 10, '', 'ec910a1d717549f7497d7acef1e133d9'),
(7485, 'en', 'WordPress', '68ff8e47448b84d116faca89d63a3125', 'WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.', NULL, 'LINE', NULL, 10, '', '536c9297d7b689b90ef742eb8e0dfa4c'),
