(7487, 'en', 'WordPress', '920b86d822cd25a2a2c592134fd08ce1', 'WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We&#8217;re flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.', NULL, 'LINE', NULL, 10, '', 'df27f9522759fe6788128267a7225c2a'),
(7488, 'en', 'WordPress', 'ca2e1c6fdebc7887415465aaaf360960', 'WordPress has been installed. Thank you, and enjoy!', NULL, 'LINE', NULL, 10, '', '5469cdad8083c4bd430e22fa3829a8f5'),
