(7490, 'en', 'WordPress', '87488821d95fad046e6934ba9a27f016', 'WordPress is Free and open source software, built by a distributed community of mostly volunteer developers from around the world. WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.', NULL, 'LINE', NULL, 10, '', 'aaed0e61a96f1ece711deff370d6c52c'),
