(7492, 'en', 'WordPress', '98139c5279fc772772d86ebf86967fbf', 'WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals. <a href="%2$s">Get involved in WordPress</a>.', NULL, 'LINE', NULL, 10, '', 'e294fa791bbaa32d783630af4cd816db'),
