(7494, 'en', 'WordPress', '3b98198031b8bee41ff60f1245f613b7', 'WordPress is not notifying any <a href="https://codex.wordpress.org/Update_Services">Update Services</a> because of your site&#8217;s <a href="%s">visibility settings</a>.', NULL, 'LINE', NULL, 10, '', '4d71575b5f84f75a96c6e9e360117952'),
(7495, 'en', 'WordPress', 'f2187a07f70a08b8d7c5fdca5f133a0e', 'WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="https://codex.wordpress.org/Using_Permalinks">number of tags are available</a>, and here are some examples to get you started.', NULL, 'LINE', NULL, 10, '', '0f5d80f564891eff901fcf28ff6f4858'),
