(7524, 'en', 'WordPress', 'fb6988136bd760e714d6eb920bd33c59', 'You are not allowed to delete this item.', NULL, 'LINE', NULL, 10, '', 'ecb308560e18d8c131bfdc581fec6b72'),
(7525, 'en', 'WordPress', '7a23719a229e4f4457078d77a8b46552', 'You are not allowed to edit comments on this post.', NULL, 'LINE', NULL, 10, '', '81868a57515b8d2d1ab65b97440064c9'),
(7526, 'en', 'WordPress', '64e740568d5b35dfaafd38d58e98ea17', 'You are not allowed to edit comments.', NULL, 'LINE', NULL, 10, '', 'ac8675b65c167822cc613f3f4c4b4cb8'),
(7527, 'en', 'WordPress', 'aa651fae12fd722e25ee30c998acff0b', 'You are not allowed to edit pages as this user.', NULL, 'LINE', NULL, 10, '', 'f41d8a104b5714ca6447e1bce88edf61'),
(7528, 'en', 'WordPress', '23d7536067dfd41102cb479b0334310a', 'You are not allowed to edit pages.', NULL, 'LINE', NULL, 10, '', '69710d6522fed155e804992b822dafcc'),
(7529, 'en', 'WordPress', 'ac3dbc721b886a5e23774b94c43a35b4', 'You are not allowed to edit posts as this user.', NULL, 'LINE', NULL, 10, '', '55728591e901bb92a9a8b6f9b9353490'),
(7530, 'en', 'WordPress', '623718938bbe2ccf4bf6c3ca2874c20f', 'You are not allowed to edit posts.', NULL, 'LINE', NULL, 10, '', 'e306fd2e4b29f6c71d96cb833cb3e045'),
(7531, 'en', 'WordPress', 'e70f38df11dfe2fd6ddb8ca7d7568009', 'You are not allowed to edit this attachment.', NULL, 'LINE', NULL, 10, '', '42dc1674474e5679db4f443b3f90fa6c'),
(7532, 'en', 'WordPress', 'b2f4f25f7b23e49fdfdc8b04a7583384', 'You are not allowed to edit this comment.', NULL, 'LINE', NULL, 10, '', '90758fee525f1796578a3ddb833eb5ce'),
(7533, 'en', 'WordPress', 'f5e1d38369cfb8db8c9e7384a8aa5f6c', 'You are not allowed to edit this item.', NULL, 'LINE', NULL, 10, '', '28b49a5a8b865b96173530bf8d18e5b3'),
(7534, 'en', 'WordPress', '3cc133978a511d4d3bcae6b22370906f', 'You are not allowed to edit this page.', NULL, 'LINE', NULL, 10, '', '9bc24071bf26be9cf09de19c0b3b3402'),
(7535, 'en', 'WordPress', 'd1068681329f20070771629164effd07', 'You are not allowed to edit this post.', NULL, 'LINE', NULL, 10, '', '9d4997ae5c5a4b728c7c69afba031910'),
(7536, 'en', 'WordPress', '758dea342a933955cc635aca790c024e', 'You are not allowed to import.', NULL, 'LINE', NULL, 10, '', '155e79b0ef3735cf2f18b8fdc46a7675'),
(7537, 'en', 'WordPress', 'bd3ba9b995ee919e2836410a6c216dfb', 'You are not allowed to manage these items.', NULL, 'LINE', NULL, 10, '', '020057aaa1819ba4241ff252f02dd0a8'),
(7538, 'en', 'WordPress', '479c7988c0417a235873c5778f6f8f99', 'You are not allowed to manage this item.', NULL, 'LINE', NULL, 10, '', '6b97fb8432224302f7a6d6cff55493ec'),
(7539, 'en', 'WordPress', 'e741a293301db431dda9b6d928fb5e59', 'You are not allowed to move this item out of the Trash.', NULL, 'LINE', NULL, 10, '', 'c1fee0c5b26b77fb63803ac7201d5bfe'),
(7540, 'en', 'WordPress', '9fd363a503ec1e8b3f6319acd0f887d8', 'You are not allowed to move this item to the Trash.', NULL, 'LINE', NULL, 10, '', 'f98d0f1668383271812db0f884eaa878'),
(7541, 'en', 'WordPress', 'df5ca5fde85cc0f1783cd004dc69a8d7', 'You are not allowed to restore this item from the Trash.', NULL, 'LINE', NULL, 10, '', '9d11929a23637e827e5cfd1c6064afc6'),
(7542, 'en', 'WordPress', '96cef5b3d6d082373acf8e547cf63ed4', 'You are now logged out everywhere else.', NULL, 'LINE', NULL, 10, '', '90b632853889cf38cc9477f727494664'),
(7543, 'en', 'WordPress', 'f6435aa05732baca22a6de8167d3bfd8', 'You are only logged in at this location.', NULL, 'LINE', NULL, 10, '', '852571734fffbd144f5775031be30889'),
(7544, 'en', 'WordPress', 'a2ffc66c941814a9d5b0bb75664a1438', 'You are using a development version (%1$s). Cool! Please <a href="%2$s">stay updated</a>.', NULL, 'LINE', NULL, 10, '', 'cfc2fcacd6ab3c5d51f7092c3bc5275d'),
(7545, 'en', 'WordPress', 'ead95faf097c050ce8272235ab6d14c4', 'You are using a development version of WordPress. These feature plugins are also under development. <a href="%s">Learn more</a>.', NULL, 'LINE', NULL, 10, '', 'e9ca0a7db291fe5ff4cfe48ffbd107e6'),
(7546, 'en', 'WordPress', '0831c7f191359bccd2f20b3848878c08', 'You are using a development version of WordPress. You can update to the latest nightly build automatically or download the nightly build and install it manually:', NULL, 'LINE', NULL, 10, '', '078e04975347522955afb7cf72de5e22'),
(7547, 'en', 'WordPress', '0f823bed6cba9b8049dc4eecf9eee287', 'You are using an insecure browser!', NULL, 'LINE', NULL, 10, '', '6b4dfbe4507c5b2250e6c2954efcc0c2'),
(7548, 'en', 'WordPress', 'ffa32f3198455426db78715a26184f3d', 'You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.', NULL, 'LINE', NULL, 10, '', '37eee8bcc8c16c3d8c6c14e46afff8ad'),
(7549, 'en', 'WordPress', '185a58071513be42df712fa7aa59c054', 'You are using the multi-file uploader. Problems? Try the <a href="%1$s" target="%2$s">browser uploader</a> instead.', NULL, 'LINE', NULL, 10, '', 'ba9f451886a62ba04249b480e7c944ed'),
(7550, 'en', 'WordPress', '313fdf221f4a041ed3d772112928e653', 'You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.', NULL, 'LINE', NULL, 10, '', 'cac3df20378cb078a94d0b30bb9a0b53'),
(7551, 'en', 'WordPress', '7f735a3de4fa14b113264f459aa23a72', 'You attempted to edit an attachment that doesn&#8217;t exist. Perhaps it was deleted?', NULL, 'LINE', NULL, 10, '', 'e30f6f27adc6305a574b59750895bbbd'),
(7552, 'en', 'WordPress', '30ea891c72c225103705a6d5327fb6da', 'You attempted to edit an item that doesn&#8217;t exist. Perhaps it was deleted?', NULL, 'LINE', NULL, 10, '', '792208330a59a3ad7ded6014b7723b83'),
(7553, 'en', 'WordPress', '63e10978f6765868b1d450b854d82fc7', 'You attempted to edit an item that isn&#8217;t an attachment. Please go back and try again.', NULL, 'LINE', NULL, 10, '', '29d2a8205ffdc8103ddc21f6c46aff1c'),
(7554, 'en', 'WordPress', '1597e47943552acb2159f24763d2183b', 'You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.', NULL, 'LINE', NULL, 10, '', 'a954ec5faa0fd0c976838d132e1d284e'),
(7555, 'en', 'WordPress', 'a028caf874f7a36b4d04977846a44352', 'You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.', NULL, 'LINE', NULL, 10, '', '405bdde6d4efd167eb8a0f848d07627a'),
(7556, 'en', 'WordPress', '5d8dccaf5152dadcf683142ff8e39d85', 'You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.', NULL, 'LINE', NULL, 10, '', 'a6407e27106394eda12a109b4685fc18'),
(7557, 'en', 'WordPress', '68219ec1373a07050daabcab0c978815', 'You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.', NULL, 'LINE', NULL, 10, '', 'e82abd4ff8f01e32712710ec155e8e16'),
(7558, 'en', 'WordPress', 'dad4f8937c58c81d36bd370afacbf323', 'You can also browse a user&#8217;s favorite plugins, by using the Favorites link in the upper left of the screen and entering their WordPress.org username.', NULL, 'LINE', NULL, 10, '', '927f493ed8e06b8fc4b54a4e9618b471'),
(7559, 'en', 'WordPress', '4f2592dccb64c180a81e4a042fe70670', 'You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', NULL, 'LINE', NULL, 10, '', 'd601d9af0d46a2c5aea0259cd72437f1'),
(7560, 'en', 'WordPress', 'b036d24917cf1c11f1fd7d74084a73d6', 'You can also control the display of your content in RSS feeds, including the maximum numbers of posts to display and whether to show full text or a summary.', NULL, 'LINE', NULL, 10, '', 'baba3753a4e9228dd9aca6088127deb8'),
(7561, 'en', 'WordPress', '464b4a78bca01186db0bc144f178c5f1', 'You can also create posts with the <a href="%s">Press This bookmarklet</a>.', NULL, 'LINE', NULL, 10, '', 'f2794381076490f051f639938d3743db'),
(7562, 'en', 'WordPress', '972d412b5c2482e96d24171ef27553c5', 'You can also delete individual items and access the extended edit screen from the details dialog.', NULL, 'LINE', NULL, 10, '', 'c56cf858bae8176d0cbd31863f4e145a'),
(7563, 'en', 'WordPress', 'c83a2faddec053e93996bea49df84dd8', 'You can also edit or move multiple posts to the trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.', NULL, 'LINE', NULL, 10, '', '4e9fcbb2152447c038a7a32fb57d55fc'),
(7564, 'en', 'WordPress', '5860a8fa3ef1ea4cf6657c47ed83e90c', 'You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. Please refer to the Codex to <a href="https://codex.wordpress.org/Embeds">learn more about embeds</a>.', NULL, 'LINE', NULL, 10, '', '1338b3b0639580d67f7b03c46610b4bc'),
(7565, 'en', 'WordPress', '001ae354418426ceb96e7d035ad9de3c', 'You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.', NULL, 'LINE', NULL, 10, '', '76fffd3690de924ddaf6784013d84dd3'),
(7566, 'en', 'WordPress', '653290ee830033b040967d621084cb0f', 'You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk Actions menu to edit the metadata for multiple pages at once.', NULL, 'LINE', NULL, 10, '', '311b296fb80f6abb6417d7a9247bf27f'),
(7567, 'en', 'WordPress', 'ff2945d6f4371f51df1c739ba60f27ae', 'You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there&#8217;s no relationship from one tag to another.', NULL, 'LINE', NULL, 10, '', '99bdc6b95922a5e11026d2f0e497cefa'),
(7568, 'en', 'WordPress', '72caeed1ff140d706e86977a0bf7d12c', 'You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.', NULL, 'LINE', NULL, 10, '', 'f75a8332a3a5f0b3fc7a01c4545d4cad'),
(7569, 'en', 'WordPress', 'ceb79a4cdaccc9c24ea22489ba03429f', 'You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.', NULL, 'LINE', NULL, 10, '', '8681e0c6f5489c49be40d0288abae247'),
(7570, 'en', 'WordPress', 'aa6b50ebfd26013f727b5bddd1a0020a', 'You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.', NULL, 'LINE', NULL, 10, '', '18cb1a401aaac21f74f04b7970a8b75c'),
(7571, 'en', 'WordPress', 'ed3a1364a6f32d0152a9a84b1badda00', 'You can change your profile picture on <a href="%s">Gravatar</a>.', NULL, 'LINE', NULL, 10, '', 'f03bb7f66a4b89a07382d406b93ed789'),
(7572, 'en', 'WordPress', '3a94690f89aea910c66bdb3b6fff1fc0', 'You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.', NULL, 'LINE', NULL, 10, '', 'f4a53a39cff926c4feafcfbae56894c3'),
(7573, 'en', 'WordPress', '60a664b6a8f309a460918c0a26f8a6c1', 'You can choose one of your previously uploaded headers, or show a random one.', NULL, 'LINE', NULL, 10, '', '975f767cee1d9f6089eb9cfb39122ab3'),
(7574, 'en', 'WordPress', '64569debf6bd3abbd212384c1a3d0a46', 'You can choose what&#8217;s displayed on the front page of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static home page, you first need to create two <a href="%s">Pages</a>. One will become the front page, and the other will be where your posts are displayed.', NULL, 'LINE', NULL, 10, '', '25c17edac6c74ae98ae2ab292560c917'),
(7575, 'en', 'WordPress', '0754b49868a7a0ac641085882e136d75', 'You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen. Note that your privacy is not complete; your site is still visible on the web.', NULL, 'LINE', NULL, 10, '', 'aceb981440ad7d81528d9cd485cda58a'),
(7576, 'en', 'WordPress', '4e171722a615bf0a18d4a10f47f71464', 'You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.', NULL, 'LINE', NULL, 10, '', '67395c8484710533455cf0c5322a19bc'),
(7577, 'en', 'WordPress', 'f88f2ffbd623a95e6cdda7118b8edd35', 'You can create the %s manually and paste the following text into it.', NULL, 'LINE', NULL, 10, '', '7e975e4e7b75f684439630b5cb0ac5f2'),
(7578, 'en', 'WordPress', '3f1914dd8eecd9de86a33cddc8389cbb', 'You can customize the display of this screen in a number of ways:', NULL, 'LINE', NULL, 10, '', '27cb9a94310227692c811246baedce6c'),
(7579, 'en', 'WordPress', 'd6ea257fc3b6e7e133f43b11581d331a', 'You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.', NULL, 'LINE', NULL, 10, '', 'c29c2aa56a601cd5553159035b5da9e8'),
(7580, 'en', 'WordPress', '8ac8e55c35195400fff6756b49835523', 'You can customize the display of this screen&#8217;s contents in a number of ways:', NULL, 'LINE', NULL, 10, '', '0f389356cdd59a51573b70769017cf73'),
(7581, 'en', 'WordPress', 'ea5fcb3e59f97c7e70111b588d78d687', 'You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.', NULL, 'LINE', NULL, 10, '', '9ea9cb063e18947cfeb380ac3fbf9373'),
(7582, 'en', 'WordPress', '5aaf5b7354c090ad1a53700fdd8fe022', 'You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.', NULL, 'LINE', NULL, 10, '', '069101bfb13665b67169f98aa1d5d85a'),
(7583, 'en', 'WordPress', '319980b189e432ee59526496b2fc7bd7', 'You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.', NULL, 'LINE', NULL, 10, '', '534a43a340a24554c1bf4bd6e1585a06'),
(7584, 'en', 'WordPress', '29a977dfe4c91dbbb1970d8a38a81a2a', 'You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.', NULL, 'LINE', NULL, 10, '', 'e5641cae7516f7f790ed8970b6ea3ce3'),
(7585, 'en', 'WordPress', 'd5fb0f5d059e20b79f51ba2cb67696b2', 'You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.', NULL, 'LINE', NULL, 10, '', '1de77d2da404c6fce645afd7e9f42685'),
(7586, 'en', 'WordPress', '439e85bf8c00d0e5d97a3f08a503f1ce', 'You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.', NULL, 'LINE', NULL, 10, '', 'f15837ac997630cd10b8c2fb5366823a'),
(7587, 'en', 'WordPress', '4a24fcfc875d0f69f1435e39a1388fb3', 'You can filter the list of posts by post status using the text links in the upper left to show All, Published, Draft, or Trashed posts. The default view is to show all posts.', NULL, 'LINE', NULL, 10, '', '6ec2f1f45d299aef6ff58c4ad0d76634'),
(7588, 'en', 'WordPress', '9532dc62b333bf4a6bd2c858151859e4', 'You can filter the list of users by User Role using the text links in the upper left to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.', NULL, 'LINE', NULL, 10, '', 'b8c913e31f44a37cba4da842843ce552'),
(7589, 'en', 'WordPress', '51f1313ec9b5d180cc14615dd1387c60', 'You can find additional plugins for your site by using the <a href="%1$s">Plugin Browser/Installer</a> functionality or by browsing the <a href="%2$s" target="_blank">WordPress Plugin Directory</a> directly and installing new plugins manually. To manually install a plugin you generally just need to upload the plugin file into your %3$s directory. Once a plugin has been installed, you can activate it here.', NULL, 'LINE', NULL, 10, '', '2b78e423101784c9104048a5fade491a'),
(7590, 'en', 'WordPress', '99f572d55d32b2c5f8c041aeefcc788b', 'You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s" target="_blank">WordPress.org Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.', NULL, 'LINE', NULL, 10, '', '5d1eebea683e0afad6b13a1be5ba42d2'),
(7591, 'en', 'WordPress', 'd6e863468c3551518fa205b1060b3cf3', 'You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.', NULL, 'LINE', NULL, 10, '', 'd9aa5c3c0e673ba8771610d2bea3ace6'),
(7592, 'en', 'WordPress', '67e7c46d3d5c2108c0e99ceea6441dee', 'You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.', NULL, 'LINE', NULL, 10, '', '77d0a49de230cf73cbc7eb49b35a7386'),
(7593, 'en', 'WordPress', 'de8768b94597e0280a0f1177f2e46900', 'You can insert media files by clicking the icons above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.', NULL, 'LINE', NULL, 10, '', 'dbadf7c83fae1a9c5cc879753a43c663'),
(7594, 'en', 'WordPress', 'b9ee24b2ed698a7774a132f859a7440b', 'You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.', NULL, 'LINE', NULL, 10, '', '9ae9738823d0acbb5f40dee495b5256a'),
(7595, 'en', 'WordPress', '74ec803b504414d42126006142f54490', 'You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the Bulk Actions.', NULL, 'LINE', NULL, 10, '', '43b16e936d590b31a7723b11758d51bc'),
(7596, 'en', 'WordPress', '82169939daa05d25d68df1a2d649d306', 'You can narrow the list by file type/status or by date using the dropdown menus above the media table.', NULL, 'LINE', NULL, 10, '', '1d1e8993a4691622f13cf44fe9c3028a'),
(7597, 'en', 'WordPress', 'ae310675793fc7bfa950b8760f79a4f1', 'You can now manage and live-preview Custom Backgrounds in the <a href="%1$s">Customizer</a>.', NULL, 'LINE', NULL, 10, '', 'ed7fb9bad5d76d9e648a35e96d9e4a7a'),
(7598, 'en', 'WordPress', '5c71e77cf2c930baea8c287753a229c2', 'You can now manage and live-preview Custom Header in the <a href="%1$s">Customizer</a>.', NULL, 'LINE', NULL, 10, '', '7709d07d31073e9236a89ee38d7fca6f'),
(7599, 'en', 'WordPress', '82deca0fb59319be08a217a38bcd7d23', 'You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.', NULL, 'LINE', NULL, 10, '', 'c8572c605148ee253ccccb05e2a5b8fe'),
(7600, 'en', 'WordPress', 'a4e5684835acb802ee3194c309c7ed1a', 'You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.', NULL, 'LINE', NULL, 10, '', '6d7dba500084573968e9fcc604d7f917'),
(7601, 'en', 'WordPress', '3466e4fdb669b751b77cbac98d3b8a72', 'You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.', NULL, 'LINE', NULL, 10, '', '22190947188cd14da509f0d1da2fc062'),
(7602, 'en', 'WordPress', 'bc6ead191133be47290a0774386abc1e', 'You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.', NULL, 'LINE', NULL, 10, '', 'f6c9e4ba897196ee7dd4164b8f57f968'),
(7603, 'en', 'WordPress', 'ca07cec969f8aa527834073e21e414b6', 'You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.', NULL, 'LINE', NULL, 10, '', '21e7802e362c3f9f98352153e2a2b685'),
(7604, 'en', 'WordPress', '8f52d6a439157f46ebbd2782a6ce2a22', 'You can set the language, and the translation files will be automatically downloaded and installed (available if your filesystem is writable).', NULL, 'LINE', NULL, 10, '', 'aa8c9e76695302a48f586b418307d91b'),
(7605, 'en', 'WordPress', '0587e968316b6f9279f46763cd67c781', 'You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.', NULL, 'LINE', NULL, 10, '', '395b55cbb7d6b3bae9736beab67864f9');
INSERT INTO `jd_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`) VALUES
(7606, 'en', 'WordPress', '562a2da5ecf13083d751ce8dd9905d10', 'You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.', NULL, 'LINE', NULL, 10, '', '06e27a35fd67f1b9e2dcca117ef677bb'),
(7607, 'en', 'WordPress', '4d000a3cfd1dbba89b2becfdefbd1612', 'You can update to <a href="https://codex.wordpress.org/Version_%1$s">WordPress %2$s</a> automatically or download the package and install it manually:', NULL, 'LINE', NULL, 10, '', '2586c80c51e325e01e0c24ab961f4b3f'),
(7608, 'en', 'WordPress', 'e4d5552eac3895bbac77d104bb1ac888', 'You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.', NULL, 'LINE', NULL, 10, '', 'b353bed2f75cd7adbd86a9029e5f3779'),
(7609, 'en', 'WordPress', '09df6ae117e587dd779421384cd15bff', 'You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:', NULL, 'LINE', NULL, 10, '', '61bf340ddeff76e74568e27036635128'),
(7610, 'en', 'WordPress', '4d26943fa96797a4136ef47c5084b772', 'You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.', NULL, 'LINE', NULL, 10, '', '14a6608e1f8e61a670cfc5bf470c4226'),
(7611, 'en', 'WordPress', 'c5466e9372fdad7ba27494dd68c9fcb2', 'You can use one of these cool headers or show a random one on each page.', NULL, 'LINE', NULL, 10, '', '9679c8108c59605a8f2c386dcb3652f5'),
(7612, 'en', 'WordPress', '9dcafd51d543cab7ea08e0fb30981f9c', 'You can use the Theme Editor to edit the individual CSS and PHP files which make up your theme.', NULL, 'LINE', NULL, 10, '', 'e623e56c2f6b2b3f17331b1b9b371bb2'),
(7613, 'en', 'WordPress', 'c0ed5e3f5e633991901390dd59336cc6', 'You can use the editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.', NULL, 'LINE', NULL, 10, '', 'b5f61f27daf7affdffc5d7deff8e2a3d'),
(7614, 'en', 'WordPress', '5d3cfb1969cd32ce072f4a154329dbf9', 'You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.', NULL, 'LINE', NULL, 10, '', '1bee851fffc7da478c0591605040ba04'),
(7615, 'en', 'WordPress', '809cd0ac3a99a17e88b7af070dcb1d97', 'You can view all posts made by a user by clicking on the number under the Posts column.', NULL, 'LINE', NULL, 10, '', '4021df53b92ee6ee6335a3ded128645e'),
(7616, 'en', 'WordPress', '69bf2bc0a778d2be3e4a04bc44a4f549', 'You can view posts in a simple title list or with an excerpt using the Screen Options tab.', NULL, 'LINE', NULL, 10, '', '5cc81834bde7a01512a3c84d6aa5b5b9'),
(7617, 'en', 'WordPress', '536f7f35770e99a3c83984d589a7e2c1', 'You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.', NULL, 'LINE', NULL, 10, '', '7c6c7d1bb8ad46e17161a9ead8692836'),
(7618, 'en', 'WordPress', '52699cf314da87233727d08a6f3d8f2e', 'You can&#8217;t delete that user.', NULL, 'LINE', NULL, 10, '', 'a62090448b9399ead2c815ece6c27264'),
(7619, 'en', 'WordPress', '0ba7d2aceb1e3523389309177b68f301', 'You can&#8217;t delete the current user.', NULL, 'LINE', NULL, 10, '', 'c6c8291a027cdabc6a322e1771b0079f'),
(7620, 'en', 'WordPress', 'c974f451d5c9f48ea82f37c9bf050e4c', 'You can&#8217;t delete users.', NULL, 'LINE', NULL, 10, '', 'efb773842631bd6bce9460aab7c7d774'),
(7621, 'en', 'WordPress', 'c6c6becba2cd4fae5836a0f7806d7212', 'You can&#8217;t edit that user.', NULL, 'LINE', NULL, 10, '', 'a1af025355418add0663f4435131051d'),
(7622, 'en', 'WordPress', '8f202ef980323b961b4772629bedd1e1', 'You can&#8217;t edit this attachment because it is in the Trash. Please move it out of the Trash and try again.', NULL, 'LINE', NULL, 10, '', '538f993951ede96dbf9c1cb336eead2a'),
(7623, 'en', 'WordPress', '2e55a67bc4775ccbeb957f8ac48542d6', 'You can&#8217;t edit this item because it is in the Trash. Please restore it and try again.', NULL, 'LINE', NULL, 10, '', 'af962977d1dd13089f070a896cf161ef'),
(7624, 'en', 'WordPress', '418bfc8c609d4e4688d50eaf15e0f2b9', 'You can&#8217;t give users that role.', NULL, 'LINE', NULL, 10, '', 'ba07a4b00874cf0e42ce621fccb4f804'),
(7625, 'en', 'WordPress', '1ed040d2bd69736871c3b386dc066d07', 'You can&#8217;t remove users.', NULL, 'LINE', NULL, 10, '', '3b247be1829be2725514d1792d0b1bb9'),
(7626, 'en', 'WordPress', '42760c290b5dd70549bd26bd19df254b', 'You can\'t remove the current user.', NULL, 'LINE', NULL, 10, '', 'e4fcd8babfea67f811802f7b728855b6'),
(7627, 'en', 'WordPress', '3f334c7e52a82632c6c079af0e2fd865', 'You cannot delete a plugin while it is active on the main site.', NULL, 'LINE', NULL, 10, '', '5783bf73cce7b6c37899cf13db6f1a96'),
(7628, 'en', 'WordPress', 'a59e9803ef8f9c934b599c7bc82ebb85', 'You cannot delete a theme while it has an active child theme.', NULL, 'LINE', NULL, 10, '', 'b45873bc4367ee397b068792f8cad2e2'),
(7629, 'en', 'WordPress', '00bedaae09117c56e382ed2dd136d06f', 'You cannot install because <a href="https://codex.wordpress.org/Version_%1$s">WordPress %1$s</a> requires MySQL version %2$s or higher. You are running version %3$s.', NULL, 'LINE', NULL, 10, '', '3d6cb61c6d377d2cd644615c21b1c58c'),
