(7662, 'en', 'WordPress', '7167162991d8800ebce7e1bd624574d9', 'You have access to the source code, the freedom to study how the program works, and the freedom to change it to make it do what you wish.', NULL, 'LINE', NULL, 10, '', '8d872746b7810da46c819e36b4a506ce'),
(7663, 'en', 'WordPress', '231c8ae8e02bd4937e66b0fa0b9588ad', 'You have chosen to delete the following users from all networks and sites.', NULL, 'LINE', NULL, 10, '', '9eda99faf9e7b21af786c2d726500eb2'),
