(7669, 'en', 'WordPress', 'ebe4c21683e008d862e4e5f729a203de', 'You have the freedom to distribute copies of your modified versions to others. By doing this you can give the whole community a chance to benefit from your changes.', NULL, 'LINE', NULL, 10, '', '2f6a354b4af4239107d81f0d239e9e15'),
(7670, 'en', 'WordPress', 'd0b1d308c36a91f47ad5e072aaae6a4f', 'You have the freedom to redistribute copies of the original program so you can help your neighbor.', NULL, 'LINE', NULL, 10, '', 'a870837df20f56b4f89278cf29ff5aac'),
(7671, 'en', 'WordPress', '7a7e94999871e055f0ea180174c53e92', 'You have the freedom to run the program, for any purpose.', NULL, 'LINE', NULL, 10, '', 'b9d6cac6d470d45fd0567e09aa08ba80'),
