(7685, 'en', 'WordPress', 'beaf0116620161dfd235826de23b0914', 'You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> more themes.', NULL, 'LINE', NULL, 10, '', 'db4535e4a6e1971723e80effe0882073'),
