(13404, 'en', 'js_composer', 'cdd07c76614335c0db1439112aacf152', 'To get your support related question answered in the fastest timing, please head over to our <a href="%s" target="_blank">support page</a> and open Support ticket. To open support ticket you should have account in the ticket system. Registration should take you couple of minutes to complete and is completely automatic process. Prepare your Visual Composer <a href="%s" target="_blank">Purchase code</a> and fill in "Create account in Ticket system" form located at <a href="%s" target="_blank">support page</a>, then follow on screen instructions.', NULL, 'LINE', NULL, 0, '', '5bc7280a5abb44be0f74ee8beea41a9e'),
(13405, 'en', 'js_composer', '74778e4269c74d37921452d75f5d5869', 'Before applying for support please make sure you understand the rules of support and go through all steps described and listed in <a href="%s" target="_blank">Support Policy</a> in order to get your issues solved as soon as possible.', NULL, 'LINE', NULL, 0, '', '5adb4aa4a021c3830fc2ebccc36aa6d0'),
(13406, 'en', 'js_composer', 'fc00670962b3a25e3bfaf29b27a96361', 'There are several resources available to Visual Composer users to help you to get around plugin:', NULL, 'LINE', NULL, 0, '', '9d8ab0d2098a8d5df3b62b85f3e37ba4'),
(13407, 'en', 'js_composer', 'bf9546f25ac66c9723b1707d19dee45c', 'Official Support', NULL, 'LINE', NULL, 0, '', '271b68c6de6946b73a0a741c7040133c'),
(13408, 'en', 'js_composer', '322ab8d30c5314128d86725b5b5900d1', 'More Control and Lighter Interface', NULL, 'LINE', NULL, 0, '', '63d4645306dd2004b9906e1ccd6f5404'),
(13409, 'en', 'js_composer', '5fa0002c80a234dde133291d8649781b', 'Visual Composer 4.8 offers smart controls for easy and powerful user group role access. Now you can reduce number of options and features available to your content editors or people with non-IT skills. This results in less things to learn in order to start managing content of your site.', NULL, 'LINE', NULL, 0, '', '2726d91db06b3dc4b7c2d15523bfcc18'),
(13410, 'en', 'js_composer', '1ee22399de4af96522d3300b5402c7f2', 'Carefully crafted preview of templates allows you to see Backend editor style template layouts before adding them to your page or post. There is no more need to remember title of each and every template within your list - simply reveal preview and decide yourself if this is a best match for your page.', NULL, 'LINE', NULL, 0, '', 'cb860315760acc3560d9ceb09af05666'),
(13411, 'en', 'js_composer', '847089b1ce4705e022c9f1b9cf7d3a6b', 'User Group Roles Access', NULL, 'LINE', NULL, 0, '', 'cb665ab4c495502d6e255a5cbee118fa'),
(13412, 'en', 'js_composer', '96cfd361ac53efdb63b819f80f8e7ac0', 'Powerful control mechanisms for managing options and features available for different user group roles.', NULL, 'LINE', NULL, 0, '', '135f0ab9faf41a3a1e663960c8054225'),
(13413, 'en', 'js_composer', 'db700481fed97a741f9c39c5d55cec65', 'Template Preview', NULL, 'LINE', NULL, 0, '', '635c96f2f0c36dca4fa3ee44f80f702e'),
(13414, 'en', 'js_composer', '009a0f4364dcd0f4d40be21bc2b831fe', 'See before you add - now you can reveal quick Backend editor style preview of any template including Grid Builder templates.', NULL, 'LINE', NULL, 0, '', '865f4bbc4a1d8ba9f5204c23363740d7'),
(13415, 'en', 'js_composer', '59ffa1acda8ed572fb4d6cf12311fe55', 'Minimized CSS', NULL, 'LINE', NULL, 0, '', '3862c952298157bef1e426e80e51cb2d'),
(13416, 'en', 'js_composer', '31062c0ee334989649dcff9eb79b459c', 'Minimized CSS allows reducing size of Visual Composer plugin and also have positive effect on overall performance as there is less data to load.', NULL, 'LINE', NULL, 0, '', 'fe485766a2b3d80a733c15b4f504a2c1'),
(13417, 'en', 'js_composer', 'cd93409122235e8103fd135e0502ee14', 'Element Presets Controls API', NULL, 'LINE', NULL, 0, '', '48f4be31ea984670ed8f171735b8692f'),
(13418, 'en', 'js_composer', '3da0a4e5832308809e2fe6cdec378932', 'Control element presets and set default by using Visual Composer API.', NULL, 'LINE', NULL, 0, '', 'fe7c49674756f7e7f1cf62dd0eb68c54'),
(13419, 'en', 'js_composer', 'c25b1595d77d76b157a3da5cb34f0318', 'Separator Enhancements', NULL, 'LINE', NULL, 0, '', '4e6192b3806c666b93141d341f5bb2ea'),
(13420, 'en', 'js_composer', 'e2d9f6b045765864ab2b1720ed293e1e', 'Add icons to "Separator with Text" and use new shadow style in both separator elements.', NULL, 'LINE', NULL, 0, '', 'd82320b4141787e532982797d1139a69'),
(13421, 'en', 'js_composer', '962d8412a97392e6ecd9d699eecded2e', 'Welcome Screen Design', NULL, 'LINE', NULL, 0, '', '8b5112b88ca63f43dd8fc5af38e23f71'),
(13422, 'en', 'js_composer', 'd5889b83e60b2c498460939a8b0a9cbe', 'More clean and simple Blank Welcome Screen design focusing on most important parts.', NULL, 'LINE', NULL, 0, '', 'd72bbbe6a674d87d9a39388c0fcf8ae2'),
(13423, 'en', 'js_composer', 'de4aa935e526e9bff6cb68c8f3e9e082', 'Load More Button in Grid', NULL, 'LINE', NULL, 0, '', 'b0ed2ad87c1b3dda6a9f8d47da8e9e68'),
(13424, 'en', 'js_composer', '84f8a6a40085ebd485a607b64bba1ed6', 'Load more button in Grid elements are now using latest button with all available features.', NULL, 'LINE', NULL, 0, '', 'a0faba36bc84ed2803820b874e10b831'),
(13425, 'en', 'js_composer', '14c930da3b29f8639e7dc26f6dddac97', 'Welcome to Visual Composer %s', NULL, 'LINE', NULL, 0, '', '60a2286aedb014f06ebafa6f0746cf46'),
(13426, 'en', 'js_composer', '3c9725047280b9e633385a026099deae', 'Version %s', NULL, 'LINE', NULL, 0, '', '5eca824bfe9403388ba2d44798197ea2'),
(13427, 'en', 'js_composer', '9a57e3079e26a385d0b4e95e949da12f', 'Congratulations! You are about to use most powerful time saver for WordPress ever - page builder plugin with Frontend and Backend editors by WPBakery.', NULL, 'LINE', NULL, 0, '', 'c7d599c8956bfc0a546ab3022d89c364'),
(13428, 'en', 'js_composer', '23a48c813790ded510275d4e4c6d50b6', 'WPBakery has complete documentation available at our knowledge base: <a target="_blank" href="%s">kb.wpbakery.com</a> which covers everything related to Visual Composer starting from Installation and up to more advanced features based on our Inner API.', NULL, 'LINE', NULL, 0, '', '7881cbe9d33f2650975ec1d88d996897'),
(13429, 'en', 'js_composer', 'cdbedaa4fd591ef0072818e9adf13b3f', 'New to Visual Composer or Looking for More Information?', NULL, 'LINE', NULL, 0, '', '0e64ba0343ac4cce764c12a6380d5941'),
(13430, 'en', 'js_composer', '403723f66cebd0f3f8f90ca856c362ac', 'Visit Knowledge Base for more information', NULL, 'LINE', NULL, 0, '', '4987bb59f2154a4317d4175e647256d8'),
(13431, 'en', 'js_composer', 'a3d23d9737e150b8a7d5eff2befceed5', 'Apply templates only', NULL, 'LINE', NULL, 0, '', '39c2188002b7a70f30738ec66266d6d1'),
(13432, 'en', 'js_composer', 'b9f5c797ebbf55adccdd8539a65a0241', 'Disabled', NULL, 'LINE', NULL, 0, '', '4d3b099e34a0a1eaf1ad96301c92d7aa'),
(13433, 'en', 'js_composer', '39fac5de7715ed0711acc6fa312ebe4f', 'Control access rights to templates and predefined templates. Note: "Apply templates only" restricts users from saving new templates and deleting existing.', NULL, 'LINE', NULL, 0, '', 'e588ee7554e978478b74d1317c9d5f34'),
(13434, 'en', 'js_composer', '00d23a76e43b46dae9ec7aa9dcbebb32', 'Enabled', NULL, 'LINE', NULL, 0, '', 'ed7816a006ecda21e827648a6eeac407'),
(13435, 'en', 'js_composer', 'c6532392ab6778efa22aa8ee18de6ee1', 'Control access to Visual Composer page settings. Note: Disable page settings to restrict editing of Custom CSS through page.', NULL, 'LINE', NULL, 0, '', '3af72ee984b7aa0297faa6c75c2ef1b7'),
(13436, 'en', 'js_composer', '231afe47f3f37d3808096b36c28b4ded', 'Element', NULL, 'LINE', NULL, 0, '', 'fb244c6ae383ab47d01a7aecba7f0d1f'),
(13437, 'en', 'js_composer', 'cba7e1d78d70497dca4f66bdb0157e78', 'Edit only', NULL, 'LINE', NULL, 0, '', 'e9a05feeb114d77784c4bd84e1554a45'),
(13438, 'en', 'js_composer', '780c4592d7899628322854479fa488aa', 'Control user access to content elements.', NULL, 'LINE', NULL, 0, '', '006f63c98ff6314b9c37313c24aaaa47'),
(13439, 'en', 'js_composer', '47befcac1e7ce5d204ffd3a71ade1749', 'Settings options', NULL, 'LINE', NULL, 0, '', '053d35fe00d5b612f5d60fbfb83000c9'),
(13440, 'en', 'js_composer', '360d8fa8031ea18cb03f84b9adb81b50', 'Control access rights to Visual Composer admin settings tabs (e.g. General Settings, Shortcode Mapper, ...)', NULL, 'LINE', NULL, 0, '', '062cb2264d5194ac8d0e1f19347df84a'),
(13441, 'en', 'js_composer', 'cf4a855c388c733e046a75dfccbd41c3', 'Disable Classic editor', NULL, 'LINE', NULL, 0, '', '6cf9ded748fded15ee99ba12b54b4bde'),
(13442, 'en', 'js_composer', '5225cef298c3315c0e93f3e11d0e2b93', 'Enabled and default', NULL, 'LINE', NULL, 0, '', '7368924c071089fdcb47d14e2505bc11'),
(13443, 'en', 'js_composer', 'b636632686418b74a7675dd920afc828', 'Backend editor', NULL, 'LINE', NULL, 0, '', '818e29b8ce00835399513da3b2117eac'),
(13444, 'en', 'js_composer', '83d6a7b1fef85ab7dbf56bb85b8d6808', 'Apply presets only', NULL, 'LINE', NULL, 0, '', '6eb9ead6c54cd5e1c9b9249f2868de6e'),
(13445, 'en', 'js_composer', '5e01d947d8e9d2666f12308df45b03b7', 'Control access rights to element presets in element edit form. Note: "Apply presets only" restricts users from saving new presets, deleting existing and setting defaults.', NULL, 'LINE', NULL, 0, '', '78f40d902e393e918e08d48bd62b18c5'),
(13446, 'en', 'js_composer', '18234dc21dc514b05239fb0cfb63ff2b', 'Pages only', NULL, 'LINE', NULL, 0, '', 'e92f755d4280a9a59227ca2f54dc9ab7'),
(13447, 'en', 'js_composer', '2a741d48fb4431a8e1a0be1f1598471e', 'Enable Visual Composer for pages, posts and custom post types. Note: By default Visual Composer is available for pages only.', NULL, 'LINE', NULL, 0, '', 'd8706ee56bda97af880c3aedff26924c'),
(13448, 'en', 'js_composer', '5338fe422523bbdcbb7a126079fce3ba', 'Control user access to Grid Builder and Grid Builder Elements.', NULL, 'LINE', NULL, 0, '', '8ae5726bb21e10281ce3b2e90c62c7e2'),
(13449, 'en', 'js_composer', '555ae8ed746266f3f2d347d4ac356a53', 'Frontend editor', NULL, 'LINE', NULL, 0, '', '10d51fb4c81fc13e7b8fdbc811739ed1'),
(13450, 'en', 'js_composer', 'dc9d6e1a4d7c4f5ff252dfc3c09ef452', 'Show License Activation Form', NULL, 'LINE', NULL, 0, '', 'c694d1f08717dd0f869c8aefe9201158'),
(13451, 'en', 'js_composer', '6f3ef74bd7d9bc016e879e903d7d457d', 'It is optional to activate license on localhost development environment. You can still activate license on localhost to receive plugin updates.', NULL, 'LINE', NULL, 0, '', '0e88a16d47964e5081828ea508392e92'),
(13452, 'en', 'js_composer', '1b01c015c96fd58988dbbcd1895bbf6f', 'Guide tours', NULL, 'LINE', NULL, 0, '', '35d8613b392ead60efc2bd81ce7ce541'),
(13453, 'en', 'js_composer', 'f92965e2c8a7afb3c1b9a5c09a263636', 'Done', NULL, 'LINE', NULL, 0, '', '7ad42ef444b2dea51bb84f51b0da5fb2'),
