(13455, 'en', 'js_composer', 'd80d50a05d6cd77362a623c91e937552', 'Guide tours are shown in VC editors to help you to start working with editors. You can see them again by clicking button above.', NULL, 'LINE', NULL, 0, '', '2f3cd09ed055e7c89f93837f7cd71961'),
(13456, 'en', 'js_composer', '289929755b6959902adf3af5ff6a6c35', 'Restore Default', NULL, 'LINE', NULL, 0, '', 'c21920f71f5d41d34ec90635dccc8613'),
(13457, 'en', 'js_composer', '514c416255874c6757f25041c8049bb2', 'Control user group role access to the features and options of Visual Composer - manage WordPress default and custom roles.', NULL, 'LINE', NULL, 0, '', '792d4913c4cf808cabfa0b1bfe35e4da'),
