(14851, 'en', 'contact-form-7', 'cf47107c067a0eec3f0aba9baf28031d', 'Form-tags', NULL, 'LINE', NULL, 0, '', '8996bae84ff73a1226facc1c2be1fb9a'),
(14852, 'en', 'contact-form-7', '8a2fcf93486d87e0ce6b690fc3497d61', 'Mail-tags', NULL, 'LINE', NULL, 0, '', '8a1c4d857aa28d57de893a4059b6d494'),
(14853, 'en', 'contact-form-7', '2c83a4000ea2728d74ebbdc01df343e5', 'On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.', NULL, 'LINE', NULL, 0, '', 'b19a78247936d588751be9ac139fb86b'),
(14854, 'en', 'contact-form-7', '6215de4d22a94076f05c6e81be82bda5', 'Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:', NULL, 'LINE', NULL, 0, '', '9b37ca1ff888857fe120aeeb21dfc3af'),
(14855, 'en', 'contact-form-7', '4ef427b4f52b8def1ff6563e403ad0aa', '<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.', NULL, 'LINE', NULL, 0, '', 'ea76c2469f54366347c0d04fef3cec30'),
(14856, 'en', 'contact-form-7', 'a6fdca11cd20cd9feabece957bfcadbb', '<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.', NULL, 'LINE', NULL, 0, '', 'b6e099df716ba84aada7287dc8cc23f6'),
(14857, 'en', 'contact-form-7', '5ac6fe836e5d92c56a8bc5af7a7fb064', 'On this screen, you can edit a contact form. A contact form is comprised of the following components:', NULL, 'LINE', NULL, 0, '', 'd64bcf4d957d8dafed61478b3251ca01'),
(14858, 'en', 'contact-form-7', '8d44de43f8128813c4341ae759f1bc2b', '<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.', NULL, 'LINE', NULL, 0, '', 'c5ed9c58ac7509b05ae78d439c77a948'),
(14859, 'en', 'contact-form-7', 'a25ed68c9a8e9cf1208dc06da5ca9e6d', '<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.', NULL, 'LINE', NULL, 0, '', '5880875d721835f16410b86d5cd8c14b'),
(14860, 'en', 'contact-form-7', '4573c02dd1f6585f8da85e5d065de084', '<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.', NULL, 'LINE', NULL, 0, '', '74eac5df9f32c130fc7f777145142e33'),
(14861, 'en', 'contact-form-7', 'ee9be757d9d1fc5edf191c10af054b55', '<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.', NULL, 'LINE', NULL, 0, '', '322cb620832476ea07856f78699980a3'),
(14862, 'en', 'contact-form-7', '955bb3321521ccc87f036e72c91334b7', 'In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.', NULL, 'LINE', NULL, 0, '', '2ee2f112f68da8d90881ff028fcf5cad'),
(14863, 'en', 'contact-form-7', '90e98b3c13f62af6edadcf1cb8a1f8ac', '<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.', NULL, 'LINE', NULL, 0, '', 'e2e610466e43a4c2aafbb91a66c2d2b1'),
(14864, 'en', 'contact-form-7', 'cf1e52339d6aabd416f1b9706826c14a', 'A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.', NULL, 'LINE', NULL, 0, '', 'b1969d732ba400a04aa90bfb6c1e962b'),
(14865, 'en', 'contact-form-7', '89a963521b520e09ea94ad49340f64b8', 'While form-tags have a comparatively complex syntax, you don&#8217;t need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).', NULL, 'LINE', NULL, 0, '', '1abe194b2bd158d6c5a1372abf8f7d2e'),
(14866, 'en', 'contact-form-7', 'f203d7bf1700903f826c0648ca8c84ac', 'A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.', NULL, 'LINE', NULL, 0, '', '64b230e8e0b79669dc0a20ced17e0ce7'),
(14867, 'en', 'contact-form-7', '7a8ccf0c41083f3f91e2f598329a7ae4', 'There are also special mail-tags that have specific names, but don&#8217;t have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.', NULL, 'LINE', NULL, 0, '', '31d8d53e900bbbaf4ad328ce81d17782'),
(14868, 'en', 'contact-form-7', 'b2edd70cc3b3b06f1d86330604b538ec', 'On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.', NULL, 'LINE', NULL, 0, '', '4aa6b549538b6d0b009bdb01a0ae00c0'),
(14869, 'en', 'contact-form-7', '815f676fd88b86d426d176caceb64d3f', 'You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.', NULL, 'LINE', NULL, 0, '', 'ab3df08afc2ca1b290d81243de7b3ae2'),
(14870, 'en', 'contact-form-7', '31c59d9d16d6749158364cb69e5ff108', 'Any information you provide will not be shared with service providers without your authorization.', NULL, 'LINE', NULL, 0, '', '1cb37c99ceb86b6bb955208418a905d4'),
(14871, 'en', 'contact-form-7', '55707b4848b3a26a39057e3af6948b43', 'For more information:', NULL, 'LINE', NULL, 0, '', 'fe3d0c24609149b20a0c8125e42e3df6'),
