(15226, 'en', 'members', '926bd1106f0cb4ea35312a8ce25f5760', 'Screen Content', NULL, 'LINE', NULL, 0, '', '6d19c88e706d0e7581999fe662a9a584'),
(15227, 'en', 'members', '0f05ceec0844c366727708a4f37bc8d4', 'Available Actions', NULL, 'LINE', NULL, 0, '', '7fcd4509fccc0e000ec5e67bb9779906'),
(15228, 'en', 'members', 'bfab8bcc21a91d9a7e346bbe1143c3ea', 'Bulk Actions', NULL, 'LINE', NULL, 10, '', 'ff1f75c9b6acc980f09cfdfaa9c903d8'),
(15229, 'en', 'members', '746034aba2f8b5d33468d52362eb751e', '<strong>Edit</strong> takes you to the editing screen for that role. You can also reach that screen by clicking on the role name.', NULL, 'LINE', NULL, 0, '', 'd0792f4005af1c04e75699fe3c80fe33'),
(15230, 'en', 'members', '2f687b33faf7915b55f1eb7d4ff863b4', '<strong>Delete</strong> removes your role from this list and permanently deletes it.', NULL, 'LINE', NULL, 0, '', '33f605a8fba94376e9f322de33fce2e0'),
(15231, 'en', 'members', '2f0d18f3ef5e635ea52138ff74b6cdd7', '<strong>Clone</strong> copies the role and takes you to the new role screen to further edit it.', NULL, 'LINE', NULL, 0, '', '4a3b310b541766996eaab560659cd4bc'),
(15232, 'en', 'members', 'f9f51570a95b282d09b90a3d31177ecb', '<strong>Users</strong> takes you to the users screen and lists the users that have that role.', NULL, 'LINE', NULL, 0, '', 'f35ed1869a10610d053f406ba00c11af'),
(15233, 'en', 'members', 'a5cd3ed116608dac017f14c046ea56bf', 'Roles', NULL, 'LINE', NULL, 0, '', '2a993add235b5be749ff25938b775d6b'),
(15234, 'en', 'WordPress', 'a167d4ef1f01ec7b4921c6020b680788', 'This screen provides access to all of your user roles. Roles are a method of grouping users. They are made up of capabilities (caps), which give permission to users to perform specific actions on the site.', NULL, 'LINE', NULL, 0, '', 'd434c9116b20bfa3b805e459af19b1ce'),
(15235, 'en', 'members', '99871a6a46850125b141873d5ff6ea3d', 'You can customize the display of this screen&#8216;s contents in a number of ways:', NULL, 'LINE', NULL, 0, '', '508612cbc914eb501a18d64d56bc5656'),
(15236, 'en', 'members', '4d1d3ea085e0741df5e20a4da4007d21', 'You can hide/display columns based on your needs and decide how many roles to list per screen using the Screen Options tab.', NULL, 'LINE', NULL, 0, '', '8f92266c5f7d6d3b8da433e8ebb58800'),
(15237, 'en', 'members', '2118e0758efa124acb79169f1e42338a', 'You can filter the list of roles by types using the text links in the upper left. The default view is to show all roles.', NULL, 'LINE', NULL, 0, '', 'e3e03de8fb64e8581c9ef129fc66efbd'),
(15238, 'en', 'members', '13360694bc874a789c70e0c3619572d5', 'Hovering over a row in the roles list will display action links that allow you to manage your role. You can perform the following actions:', NULL, 'LINE', NULL, 0, '', 'fdb9c94f4dfeb4bf4835e0e95fdb951a'),
(15239, 'en', 'members', '3cdce8cef14f63755c5a18414a930d7c', 'You can permanently delete multiple roles at once. Select the roles you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.', NULL, 'LINE', NULL, 0, '', 'f4754f9af2d91f5246ffedab77040955'),
(15240, 'en', 'members', '5e87945dcb9cd93c2179d85c89b9fa31', 'The requested role to edit does not exist.', NULL, 'LINE', NULL, 0, '', 'c584c2538499d6abb7d0ba045ddebaa2'),
(15241, 'en', 'members', 'd83a5c3f645ed7a341f724e297efb99b', '%s role updated.', NULL, 'LINE', NULL, 0, '', 'd62c8a659522a342194d9b0c8fc3fcf7'),
(15242, 'en', 'members', '192741da8ea3766d4f1e656f618a9199', 'The %s role is not editable. This means that it is most likely added via another plugin for a special use or that you do not have permission to edit it.', NULL, 'LINE', NULL, 0, '', 'ba40f1aadc68320a583ffba1bf412df9'),
(15243, 'en', 'members', '7158415ddd8d364c23ff16c1c0e46338', 'Edit Role', NULL, 'LINE', NULL, 0, '', '9bfc39de0ee9129e80c4c9347ffc8b3a'),
(15244, 'en', 'members', '5b6cf869265c13af8566f192b4ab3d2a', 'Documentation', NULL, 'LINE', NULL, 0, '', '7988d4a414ea910a1d64edc36d04f4dc'),
