(15247, 'en', 'members', 'b62a845d6995839eae4ef11a590ff865', 'Edit Capabilities', NULL, 'LINE', NULL, 0, '', '4f899ec028efb0048494cf8cf9ac1730'),
(15248, 'en', 'members', '29fc73532680f9a610144c773a92e720', '<strong>Grant</strong> allows you to grant the role a capability.', NULL, 'LINE', NULL, 0, '', 'bfd0a62f533149bd2da63d91c7a9d063'),
(15249, 'en', 'members', '246cc83191a6908707571106c49cfa16', '<strong>Deny</strong> allows you to explicitly deny the role a capability.', NULL, 'LINE', NULL, 0, '', 'db0bde258071f705c1e0cf1bc895356d'),
(15250, 'en', 'members', '5cd457268199a00cfff218ad328ca075', 'This screen allows you to edit an individual role and its capabilities.', NULL, 'LINE', NULL, 0, '', '115e12eb82802373531ff8450c483555'),
(15251, 'en', 'members', '3cfb32070c399c3ede70e596dbc40319', 'The role name field allows you to enter a human-readable name for your role.', NULL, 'LINE', NULL, 0, '', '927cf2efecb14cbca9c056d8f331414f'),
(15252, 'en', 'members', '1404666bacbb5c4859b9c05e55d2b2de', 'The machine-readable version of the role appears below the name field, which you can edit. This can only have lowercase letters, numbers, or underscores.', NULL, 'LINE', NULL, 0, '', 'b807ecd834016b69e510e6d7a7e472ae'),
(15253, 'en', 'members', '35113421364cac8e4f620802c0e54741', 'The capabilities edit box is made up of tabs that separate capabilities into groups. You may take the following actions for each capability:', NULL, 'LINE', NULL, 0, '', '8f546c3e71c24cb3d8c7d9bd5c6a8679'),
(15254, 'en', 'members', 'fd59c8cc1ef0063c4b1679bdf8f073c5', 'You may also opt to neither grant nor deny the role a capability.', NULL, 'LINE', NULL, 0, '', 'f473c9bf5c0ebc889c674ad630729e51'),
(15255, 'en', 'members', 'f02f440efaee011cc8b6c7e6e13f4207', 'The custom capability box allows you to create a custom capability for the role. After hitting the Add New button, it will add the capability to the Custom tab in the Edit Capabilities box.', NULL, 'LINE', NULL, 0, '', 'ba9f0447b5a40bb3d04cf311e019eb81'),
(15256, 'en', 'members', '3a3d091b16e94f6372fd6335272e0f2f', 'Grant %s capability', NULL, 'LINE', NULL, 0, '', 'f24d9c78e258522372fd3c20a6d44d77'),
