(15274, 'en', 'members', '1dbe60f94f66d2dd5fad011ea4aa3d38', 'Role and Capabilities', NULL, 'LINE', NULL, 0, '', '631daf09978627f14f2b5e37bd6c286e'),
(15275, 'en', 'members', '76a63d9f5e7e4ec6e4c1db52c924324e', 'Users, Roles, and Capabilities', NULL, 'LINE', NULL, 0, '', '72aebd80e4b9b00265023940a842b4b4'),
(15276, 'en', 'members', '12d718cdd65e28abcffc9955db74ac3a', 'The content permissions features adds a meta box to the edit post screen that allows you to grant permissions for who can read the post content based on the user\'s role. Only users of roles with the %s capability will be able to use this component.', NULL, 'LINE', NULL, 0, '', '1af7aa3730369f685060b07584e3e4d1'),
(15277, 'en', 'members', '47247b03f0c88ef31939289c0ce6218d', 'Your roles and capabilities will not revert back to their previous settings after deactivating or uninstalling this plugin, so use this feature wisely.', NULL, 'LINE', NULL, 0, '', '93b0f5a9c3c878177692206c2b130a28'),
(15278, 'en', 'members', 'd464960afd87eb81e733d6e83da63975', 'Enable the role manager.', NULL, 'LINE', NULL, 0, '', '85cc02cd94f10a63708eda270ebe1f24'),
(15279, 'en', 'members', '308b6da84c6bda8fc57f305569b27019', 'Denied capabilities should always overrule granted capabilities.', NULL, 'LINE', NULL, 0, '', 'aee249261fed68ec32e414d2b0d714e7'),
(15280, 'en', 'members', '4090331aca5a739f0403369d7aeec1de', 'Allow users to be assigned more than a single role.', NULL, 'LINE', NULL, 0, '', 'd42e25dd1bdad35f96edcf38e2e0616b'),
(15281, 'en', 'members', '668f4d6d5acf62365ccb830e8358a097', 'Enable the content permissions feature.', NULL, 'LINE', NULL, 0, '', '2934e9d920d39a96080387f4272f87c5'),
(15282, 'en', 'members', '519e1d0bb47f35a290a7757dfe598bbb', 'Enable the login form widget.', NULL, 'LINE', NULL, 0, '', '7d58def294cc3167c0fa1e7552274088'),
(15283, 'en', 'members', '64563e2fb169810e47735c3a822a1467', 'Enable the users widget.', NULL, 'LINE', NULL, 0, '', '4d81d92eb955fcdb0c60edafba2b0dc8'),
(15284, 'en', 'members', '456d1527a2807f623b61a2ee6da105aa', 'Redirect all logged-out users to the login page before allowing them to view the site.', NULL, 'LINE', NULL, 0, '', '473389cc8d51a9a2bdecbc8935ad6c1e'),
(15285, 'en', 'members', '66c41116a1db9fa4d35c3422743e8b4a', 'Show error message for feed items.', NULL, 'LINE', NULL, 0, '', 'de2388f9616f7fdf64939953342cd5e5'),
(15286, 'en', 'members', 'e608af8f977bdc3e88dcb2687018cbcc', 'The role manager allows you to manage roles on your site by giving you the ability to create, edit, and delete any role. Note that changes to roles do not change settings for the Members plugin. You are literally changing data in your WordPress database. This plugin feature merely provides an interface for you to make these changes.', NULL, 'LINE', NULL, 0, '', '0f5c1ab0a8ffefcc93996047854f12fb'),
(15287, 'en', 'members', 'b41040d604c7eaf33c2d76d65fea9667', 'Tick the checkbox for denied capabilities to always take precedence over granted capabilities when there is a conflict. This is only relevant when using multiple roles per user.', NULL, 'LINE', NULL, 0, '', '36b470af1618ba1fcae3b0864d806f11'),
(15288, 'en', 'members', '6a7166b771b6ec620c5464741581af38', 'The multiple user roles feature allows you to assign more than one role to each user from the edit user screen.', NULL, 'LINE', NULL, 0, '', '3fb157131101f394935b06efd0ad4e48'),
(15289, 'en', 'members', '9b096d794a97e00f52240056c52e44a5', 'The sidebar widgets feature adds additional widgets for use in your theme\'s sidebars.', NULL, 'LINE', NULL, 0, '', 'cf3c004b6d56aefeff3bb46620f7e178'),
(15290, 'en', 'members', '56efe376d28e73dda81a89b6a64667eb', 'The private site feature redirects all users who are not logged into the site to the login page, creating an entirely private site. You may also replace your feed content with a custom error message.', NULL, 'LINE', NULL, 0, '', '9fe47224cd705b4e842eb1c239c6b314'),
(15291, 'en', 'members', 'ef53538ae41a651c7f72ab6cb1135d8c', 'Members', NULL, 'LINE', NULL, 0, 'admin screen', '2d4c2afa344afb2da0031bff55f71075'),
(15292, 'en', 'members', '0878d79711aeef2d477d1d0455af93db', 'If no roles are selected, everyone can view the content. The post author, any users who can edit this post, and users with the %s capability can view the content regardless of role.', NULL, 'LINE', NULL, 0, '', '31bbb0988d1082dc549ce3c0b33b9bff'),
(15293, 'en', 'members', 'a841bf8d1bee88e3e74ea3c23cd9b53e', 'Message shown to users that do not have permission to view the post.', NULL, 'LINE', NULL, 0, '', 'e2b72b155ebbecb61955495ffc7cc7ef'),
(15294, 'en', 'members', '381bd321e1b85713391a2b4d0f082ca7', 'Limit access to this post\'s content to users of the selected roles.', NULL, 'LINE', NULL, 0, '', '4de0204e3ddfb0d4438030d9e8abcc8a'),
(15295, 'en', 'members', '9136fd2fc7cd46a4578f6635302c6a4c', 'Custom error message:', NULL, 'LINE', NULL, 0, '', '5d3845ad93f3c30d12b4be2791bd8de1'),
(15296, 'en', 'members', 'e0aa021e21dddbd6d8cecec71e9cf564', 'OK', NULL, 'LINE', NULL, 0, '', 'e921478e35931ef03ad28432157c743c');
